DROP TABLE IF EXISTS `fa_kefu_session`;
CREATE TABLE `fa_kefu_session` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户',
  `csr_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '客服代表ID',
  `createtime` int(10) unsigned DEFAULT NULL COMMENT '创建时间',
  `deletetime` int(10) unsigned DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='客服会话表';


DROP TABLE IF EXISTS `fa_kefu_toolbar`;
CREATE TABLE `fa_kefu_toolbar` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `position` enum('frontend','backend','general') NOT NULL DEFAULT 'backend' COMMENT '工具位置:backend=后台,frontend=前台,general=通用',
  `mark` varchar(20) NOT NULL DEFAULT '' COMMENT '唯一标识',
  `title` varchar(20) NOT NULL DEFAULT '' COMMENT '标题',
  `icon_image` varchar(200) NOT NULL DEFAULT '' COMMENT '图标',
  `data_api` varchar(200) NOT NULL DEFAULT '' COMMENT '数据接口Url',
  `card_url` varchar(200) NOT NULL DEFAULT '' COMMENT '消息卡片Url',
  `card_frontend_url` varchar(200) NOT NULL DEFAULT '' COMMENT '消息卡片Url(uni端)',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态:0=隐藏,1=正常',
  `deletetime` int(10) unsigned DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='窗口工具栏表';


DROP TABLE IF EXISTS `fa_kefu_trajectory`;
CREATE TABLE `fa_kefu_trajectory` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'KeFu用户',
  `csr_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '客服代表',
  `log_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '轨迹类型:0=访问,1=被邀请,2=开始对话,3=拒绝会话,4=客服添加,5=关闭页面,6=留言,7=其他',
  `note` text COMMENT '轨迹详情',
  `url` text COMMENT '轨迹额外数据',
  `referrer` text COMMENT '来路',
  `createtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户轨迹表';


DROP TABLE IF EXISTS `fa_kefu_user`;
CREATE TABLE `fa_kefu_user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '对应用户ID',
  `avatar` varchar(100) NOT NULL DEFAULT '' COMMENT '头像',
  `nickname` varchar(50) NOT NULL DEFAULT '' COMMENT '昵称',
  `referrer` varchar(255) NOT NULL DEFAULT '' COMMENT '用户来路',
  `contact` varchar(100) NOT NULL DEFAULT '' COMMENT '联系方式',
  `note` varchar(255) NOT NULL DEFAULT '' COMMENT '客服备注',
  `token` varchar(59) NOT NULL DEFAULT '' COMMENT 'Session标识',
  `wechat_openid` varchar(28) NOT NULL DEFAULT '' COMMENT '微信openid',
  `createtime` int(10) unsigned DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='客服用户表';


DROP TABLE IF EXISTS `fa_kefu_user_push_clientid`;
CREATE TABLE `fa_kefu_user_push_clientid` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `source` varchar(10) NOT NULL DEFAULT '' COMMENT '用户身份标识',
  `clientid` varchar(32) NOT NULL DEFAULT '' COMMENT 'clientid',
  `platform` enum('android','ios') NOT NULL DEFAULT 'android' COMMENT '用户系统平台',
  `updatetime` int(10) unsigned DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户推送clientid表';


DROP TABLE IF EXISTS `fa_liushui`;
CREATE TABLE `fa_liushui` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `use_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `user_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户名',
  `bank_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '开户行',
  `bank_num` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行卡号',
  `neirong` text COLLATE utf8mb4_unicode_ci COMMENT '详细内容',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `status` enum('0','1','2','3') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '类型:0=充值,1=提现,2=抢券,3=回购',
  `createtime` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='资金流水';


DROP TABLE IF EXISTS `fa_news`;
CREATE TABLE `fa_news` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `title` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '标题',
  `content` text COLLATE utf8mb4_unicode_ci COMMENT '内容',
  `image` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '图片',
  `createtime` int(11) DEFAULT '0' COMMENT '采集时间',
  `updatetime` int(11) DEFAULT '0' COMMENT '发布时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='财经新闻';


DROP TABLE IF EXISTS `fa_pankou`;
CREATE TABLE `fa_pankou` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `product_id` int(11) NOT NULL DEFAULT '0' COMMENT '产品ID',
  `buy1_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '买一价格',
  `buy1_num` int(11) NOT NULL DEFAULT '0' COMMENT '买一数量',
  `buy2_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '买二价格',
  `buy2_num` int(11) NOT NULL DEFAULT '0' COMMENT '买二数量',
  `buy3_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '买三价格',
  `buy3_num` int(11) NOT NULL DEFAULT '0' COMMENT '买三数量',
  `buy4_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '买四价格',
  `buy4_num` int(11) NOT NULL DEFAULT '0' COMMENT '买四数量',
  `buy5_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '买五价格',
  `buy5_num` int(11) NOT NULL DEFAULT '0' COMMENT '买五数量',
  `sell1_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '卖一价格',
  `sell1_num` int(11) NOT NULL DEFAULT '0' COMMENT '卖一数量',
  `sell2_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '卖二价格',
  `sell2_num` int(11) NOT NULL DEFAULT '0' COMMENT '卖二数量',
  `sell3_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '卖三价格',
  `sell3_num` int(11) NOT NULL DEFAULT '0' COMMENT '卖三数量',
  `sell4_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '卖四价格',
  `sell4_num` int(11) NOT NULL DEFAULT '0' COMMENT '卖四数量',
  `sell5_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '卖五价格',
  `sell5_num` int(11) NOT NULL DEFAULT '0' COMMENT '卖五数量',
  `updatetime` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='产品盘口';


DROP TABLE IF EXISTS `fa_product`;
CREATE TABLE `fa_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `category_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类id',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产品名称',
  `zimudaima` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产品代码(字母)',
  `shuzidaima` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产品代码(数字)',
  `zhangdieshu` float DEFAULT '0' COMMENT '涨跌点数',
  `zhangdiebaifenbi` float DEFAULT '0' COMMENT '涨跌百分比',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '当前价',
  `open` decimal(10,2) DEFAULT '0.00' COMMENT '今开',
  `close` decimal(10,2) DEFAULT '0.00' COMMENT '昨收',
  `high` decimal(10,2) DEFAULT '0.00' COMMENT '最高',
  `low` decimal(10,2) DEFAULT '0.00' COMMENT '最低',
  `vol` bigint(20) DEFAULT '0' COMMENT '成交量',
  `turnover_section` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '成交额区间',
  `turnover` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '成交额',
  `discount` decimal(10,2) DEFAULT NULL COMMENT '折价金额',
  `updatetime` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `weigh` int(11) NOT NULL DEFAULT '0' COMMENT '权重',
  `show_switch` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='产品管理';


DROP TABLE IF EXISTS `fa_product_log`;
CREATE TABLE `fa_product_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `product_id` int(11) NOT NULL DEFAULT '0' COMMENT '产品ID',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当前价格',
  `open` decimal(10,2) DEFAULT '0.00' COMMENT '开盘价',
  `close` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '收盘价',
  `high` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '最高',
  `low` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '最低',
  `updatetime` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='产品波动日志';


DROP TABLE IF EXISTS `fa_realname`;
CREATE TABLE `fa_realname` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) NOT NULL COMMENT '用户信息',
  `true_name` varchar(50) NOT NULL COMMENT '真实姓名',
  `id_card` varchar(18) NOT NULL COMMENT '身份证号码',
  `id_card_img_1` varchar(200) NOT NULL COMMENT '身份证正面',
  `id_card_img_2` varchar(200) NOT NULL COMMENT '身份证反面',
  `status` enum('0','1','2') NOT NULL COMMENT '审核状态:0=待审核,1=已通过,2=已驳回',
  `status_msg` varchar(100) DEFAULT NULL COMMENT '驳回原因',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='实名认证';


DROP TABLE IF EXISTS `fa_sms`;
CREATE TABLE `fa_sms` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `event` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '事件',
  `mobile` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '手机号',
  `code` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '验证码',
  `times` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '验证次数',
  `ip` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'IP',
  `createtime` int(10) unsigned DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='短信验证码表';


DROP TABLE IF EXISTS `fa_stock`;
CREATE TABLE `fa_stock` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_name` varchar(200) DEFAULT NULL,
  `stock_code` varchar(200) DEFAULT NULL,
  `stock_spell` varchar(200) DEFAULT NULL,
  `stock_type` varchar(200) DEFAULT NULL,
  `stock_gid` varchar(200) DEFAULT NULL,
  `stock_plate` varchar(200) DEFAULT NULL,
  `is_lock` int(11) NOT NULL DEFAULT '0',
  `is_show` int(11) NOT NULL DEFAULT '0',
  `add_time` datetime DEFAULT NULL,
  `spread_rate` decimal(18,4) DEFAULT '0.0000' COMMENT '点差费率',
  `increase_ratio` decimal(18,2) DEFAULT '0.00' COMMENT '涨幅比例',
  `stock_type_code` int(10) DEFAULT NULL COMMENT '股票类型code',
  `exchange` varchar(255) DEFAULT NULL,
  `stock_type_str` varchar(255) DEFAULT NULL,
  `stock_code_exchange` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `fa_test`;
CREATE TABLE `fa_test` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(10) DEFAULT '0' COMMENT '会员ID',
  `admin_id` int(10) DEFAULT '0' COMMENT '管理员ID',
  `category_id` int(10) unsigned DEFAULT '0' COMMENT '分类ID(单选)',
  `category_ids` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '分类ID(多选)',
  `tags` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '标签',
  `week` enum('monday','tuesday','wednesday') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '星期(单选):monday=星期一,tuesday=星期二,wednesday=星期三',
  `flag` set('hot','index','recommend') COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '标志(多选):hot=热门,index=首页,recommend=推荐',
  `genderdata` enum('male','female') COLLATE utf8mb4_unicode_ci DEFAULT 'male' COMMENT '性别(单选):male=男,female=女',
  `hobbydata` set('music','reading','swimming') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '爱好(多选):music=音乐,reading=读书,swimming=游泳',
  `title` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '标题',
  `content` text COLLATE utf8mb4_unicode_ci COMMENT '内容',
  `image` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '图片',
  `images` varchar(1500) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '图片组',
  `attachfile` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '附件',
  `keywords` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '关键字',
  `description` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '描述',
  `city` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '省市',
  `json` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '配置:key=名称,value=值',
  `multiplejson` varchar(1500) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '二维数组:title=标题,intro=介绍,author=作者,age=年龄',
  `price` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '价格',
  `views` int(10) unsigned DEFAULT '0' COMMENT '点击',
  `workrange` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '时间区间',
  `startdate` date DEFAULT NULL COMMENT '开始日期',
  `activitytime` datetime DEFAULT NULL COMMENT '活动时间(datetime)',
  `year` year(4) DEFAULT NULL COMMENT '年',
  `times` time DEFAULT NULL COMMENT '时间',
  `refreshtime` int(10) DEFAULT NULL COMMENT '刷新时间(int)',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  `updatetime` int(10) DEFAULT NULL COMMENT '更新时间',
  `deletetime` int(10) DEFAULT NULL COMMENT '删除时间',
  `weigh` int(10) DEFAULT '0' COMMENT '权重',
  `switch` tinyint(1) DEFAULT '0' COMMENT '开关',
  `status` enum('normal','hidden') COLLATE utf8mb4_unicode_ci DEFAULT 'normal' COMMENT '状态',
  `state` enum('0','1','2') COLLATE utf8mb4_unicode_ci DEFAULT '1' COMMENT '状态值:0=禁用,1=正常,2=推荐',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='测试表';


DROP TABLE IF EXISTS `fa_tixian`;
CREATE TABLE `fa_tixian` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `order_sn` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '订单号',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联用户',
  `shiming_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '实名姓名',
  `bank_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行名称',
  `bank_address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '开户行地址',
  `bank_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行代码',
  `bank_card` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行卡号',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提现金额',
  `status` enum('0','1','2') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '申请状态:0=待审核,1=成功,2=失败',
  `beizhu` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `createtime` int(11) NOT NULL COMMENT '申请时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='提现管理';


DROP TABLE IF EXISTS `fa_user`;
CREATE TABLE `fa_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `group_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '组别ID',
  `username` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '用户名',
  `nickname` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '昵称',
  `password` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '密码',
  `salt` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '密码盐',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '电子邮箱',
  `mobile` varchar(11) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '手机号',
  `avatar` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '头像',
  `level` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '等级',
  `gender` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `bio` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '格言',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额',
  `score` int(10) NOT NULL DEFAULT '0' COMMENT '积分',
  `successions` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '连续登录天数',
  `maxsuccessions` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '最大连续登录天数',
  `prevtime` int(10) DEFAULT NULL COMMENT '上次登录时间',
  `logintime` int(10) DEFAULT NULL COMMENT '登录时间',
  `loginip` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '登录IP',
  `loginfailure` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '失败次数',
  `joinip` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '加入IP',
  `jointime` int(10) DEFAULT NULL COMMENT '加入时间',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  `updatetime` int(10) DEFAULT NULL COMMENT '更新时间',
  `token` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'Token',
  `status` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '状态',
  `verification` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '验证',
  `is_auth` int(1) NOT NULL DEFAULT '0' COMMENT '实名认证',
  PRIMARY KEY (`id`),
  KEY `username` (`username`),
  KEY `email` (`email`),
  KEY `mobile` (`mobile`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='会员表';


DROP TABLE IF EXISTS `fa_user_bankcard`;
CREATE TABLE `fa_user_bankcard` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `bank_num` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行卡号',
  `bank_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行名称',
  `bank_address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '开户行地址',
  `bank_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行代码',
  `updatetime` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='用户银行卡';


DROP TABLE IF EXISTS `fa_user_group`;
CREATE TABLE `fa_user_group` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '组名',
  `rules` text COLLATE utf8mb4_unicode_ci COMMENT '权限节点',
  `createtime` int(10) DEFAULT NULL COMMENT '添加时间',
  `updatetime` int(10) DEFAULT NULL COMMENT '更新时间',
  `status` enum('normal','hidden') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='会员组表';


DROP TABLE IF EXISTS `fa_user_info`;
CREATE TABLE `fa_user_info` (
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级id',
  `real_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '实名',
  `paypassword` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '资金密码',
  `money` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '可用余额',
  `dongjie` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '冻结资金',
  `hongbao` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '红包余额',
  `createtime` int(11) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `login_data` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1' COMMENT '是否登录:0=关闭,1=开启',
  `trans_data` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1' COMMENT '是否交易:0=关闭,1=开启',
  `liangrong_data` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '是否两融:0=关闭,1=开启',
  `peizi_data` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '是否配资:0=关闭,1=开启',
  `dongjie_content` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '冻结理由',
  PRIMARY KEY (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='用户资料';


DROP TABLE IF EXISTS `fa_user_money_log`;
CREATE TABLE `fa_user_money_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '变更余额',
  `before` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '变更前余额',
  `after` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '变更后余额',
  `memo` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '备注',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='会员余额变动表';


DROP TABLE IF EXISTS `fa_user_rule`;
CREATE TABLE `fa_user_rule` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pid` int(10) DEFAULT NULL COMMENT '父ID',
  `name` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '名称',
  `title` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '标题',
  `remark` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '备注',
  `ismenu` tinyint(1) DEFAULT NULL COMMENT '是否菜单',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  `updatetime` int(10) DEFAULT NULL COMMENT '更新时间',
  `weigh` int(10) DEFAULT '0' COMMENT '权重',
  `status` enum('normal','hidden') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='会员规则表';


DROP TABLE IF EXISTS `fa_user_score_log`;
CREATE TABLE `fa_user_score_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `score` int(10) NOT NULL DEFAULT '0' COMMENT '变更积分',
  `before` int(10) NOT NULL DEFAULT '0' COMMENT '变更前积分',
  `after` int(10) NOT NULL DEFAULT '0' COMMENT '变更后积分',
  `memo` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '备注',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='会员积分变动表';


DROP TABLE IF EXISTS `fa_user_token`;
CREATE TABLE `fa_user_token` (
  `token` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Token',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  `expiretime` int(10) DEFAULT NULL COMMENT '过期时间',
  PRIMARY KEY (`token`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='会员Token表';


DROP TABLE IF EXISTS `fa_version`;
CREATE TABLE `fa_version` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `oldversion` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '旧版本号',
  `newversion` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '新版本号',
  `packagesize` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '包大小',
  `content` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '升级内容',
  `downloadurl` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '下载地址',
  `enforce` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '强制更新',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  `updatetime` int(10) DEFAULT NULL COMMENT '更新时间',
  `weigh` int(10) NOT NULL DEFAULT '0' COMMENT '权重',
  `status` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='版本表';


DROP TABLE IF EXISTS `fa_xingu`;
CREATE TABLE `fa_xingu` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '名称',
  `zimudaima` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产品代码(字母)',
  `shuzidaima` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产品代码(数字)',
  `shijia` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '市价',
  `chengxiaojia` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '承销价',
  `zongshengou` int(11) NOT NULL DEFAULT '0' COMMENT '总申购数',
  `yishengou` int(11) NOT NULL DEFAULT '0' COMMENT '已申购数',
  `chouqiandate` date DEFAULT NULL COMMENT '抽签日期',
  `kaifangdate` date DEFAULT NULL COMMENT '开放申购日期',
  `jiezhidate` date DEFAULT NULL COMMENT '截止申购日期',
  `faquan_date` date DEFAULT NULL COMMENT '发券日期',
  `shichanglist` enum('1','2') COLLATE utf8mb4_unicode_ci DEFAULT '1' COMMENT '发行市场:1=上市,2=上柜',
  `updatetime` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `weigh` int(11) NOT NULL DEFAULT '0' COMMENT '权重',
  `status` enum('0','1','2') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '状态:0=未开始,1=开放中,2=已结束',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='新股发布';


DROP TABLE IF EXISTS `fa_xingushengou`;
CREATE TABLE `fa_xingushengou` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `order_sn` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '申购单号',
  `user_parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属上级ID',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `pro_id` int(11) NOT NULL DEFAULT '0' COMMENT '产品ID',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '申购价',
  `shengoushuliang` int(11) NOT NULL DEFAULT '0' COMMENT '申购数',
  `zhongqianshu` int(11) NOT NULL DEFAULT '0' COMMENT '中签数',
  `xurenjiao` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '申购需认缴',
  `yingrenjiao` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '中签应认缴',
  `yirenjiao` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '已认缴',
  `renjiaocishu` int(11) NOT NULL DEFAULT '0' COMMENT '认缴次数',
  `status` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '状态:0=申购中,1=已中签,2=未中签',
  `createtime` int(11) NOT NULL DEFAULT '0' COMMENT '申购时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='新股申购';


DROP TABLE IF EXISTS `fa_yaoqingma`;
CREATE TABLE `fa_yaoqingma` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `daili_id` int(11) NOT NULL DEFAULT '0' COMMENT '代理id',
  `code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '邀请码',
  `available_num` int(11) NOT NULL DEFAULT '1' COMMENT '可用次数',
  `use_num` int(11) NOT NULL DEFAULT '0' COMMENT '已用次数',
  `status` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '状态:0=未使用,1=已使用',
  `usetime` int(11) NOT NULL DEFAULT '0' COMMENT ' 使用时间',
  `createtime` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='邀请码管理';


DROP TABLE IF EXISTS `fa_zhishu`;
CREATE TABLE `fa_zhishu` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产品名称',
  `zimudaima` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产品代码(字母)',
  `price` float DEFAULT '0' COMMENT '当前价',
  `zhangdieshu` float DEFAULT '0' COMMENT '涨跌点数',
  `zhangdiebaifenbi` float DEFAULT '0' COMMENT '涨跌百分比',
  `open` float DEFAULT '0' COMMENT '今开',
  `close` float DEFAULT '0' COMMENT '昨收',
  `high` float DEFAULT '0' COMMENT '最高',
  `low` float DEFAULT '0' COMMENT '最低',
  `vol` bigint(20) DEFAULT '0' COMMENT '成交量',
  `updatetime` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `weigh` int(11) NOT NULL DEFAULT '0' COMMENT '权重',
  `show_switch` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='指数管理';


DROP TABLE IF EXISTS `fa_zhishuchicang`;
CREATE TABLE `fa_zhishuchicang` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `order_sn` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '订单号',
  `fangxiang_data` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1' COMMENT '买入方向:0=买跌,1=买涨',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `pro_id` int(11) NOT NULL DEFAULT '0' COMMENT '产品id',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '买入价格',
  `shuliang` int(11) NOT NULL DEFAULT '0' COMMENT '买入数量',
  `benjin` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '交易本金',
  `zhuijiaxinyongjin` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '追加的信用金',
  `yingkui` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '持仓盈亏',
  `sxf_gyf` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '手续费过夜费',
  `shizhi` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '市值',
  `status` enum('1','2','3','4','5') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1' COMMENT '订单状态:1=持仓中,2=已平仓,3=平仓中,4=挂单中,5=已撤单',
  `buy_type` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1' COMMENT '买入类型:0=限价,1=市价',
  `buytime` int(11) NOT NULL DEFAULT '0' COMMENT '买入时间',
  `selltime` int(11) NOT NULL DEFAULT '0' COMMENT '卖出时间',
  `selldata` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1' COMMENT '卖出类型:0=强制平仓,1=主动卖出',
  `sellprice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '平仓价格',
  `sellmoney` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '卖出金额',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='指数持仓';


DROP TABLE IF EXISTS `fa_zixuan`;
CREATE TABLE `fa_zixuan` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `pro_id` int(11) NOT NULL DEFAULT '0' COMMENT '产品id',
  `updatetime` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `suoyin` (`user_id`,`pro_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='自选股';


DROP TABLE IF EXISTS `fa_zjsg`;
CREATE TABLE `fa_zjsg` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '用户信息',
  `pro_id` int(11) NOT NULL COMMENT '产品信息',
  `price` decimal(10,2) NOT NULL COMMENT '购入价',
  `num` int(11) NOT NULL COMMENT '数量',
  `turnover` decimal(10,2) NOT NULL COMMENT '成交额',
  `status` enum('1','2','3') NOT NULL DEFAULT '1' COMMENT '申购状态:1=申购中,2=申购成功,3=申购失败',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='折价申购';


