(844,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"高端疫苗次世代新冠疫苗一期結果出爐 追加劑可對抗BA.4、BA.5\",\"content\":\"高端疫苗 (6547-TW) 今 (1) 日宣布，國際生醫資料庫 MedRxiv 發布次世代新冠疫苗 (MVC-COV1901-Beta) 一期臨床試驗數據，證實高端的原型株、次世代疫苗作為追加劑，都可對 Beta 株、Omicron 變異株 BA.4、BA.5 產生免疫反應。為評估次世代疫苗和原型株作為追加劑的安全性、耐受性和免疫生成性，高端在北醫附醫及三軍總醫院共計收納 107 名 18~55 歲受試者，以中和抗體試驗、記憶 B 細胞試驗分析對變異株的免疫效果。高端說明，此次實驗分別使用原型株疫苗、15 mcg Beta 株疫苗及 25 mcg Beta 株疫苗施打追加劑。受試者分為 A 組 (2+1 針，間隔 8 個月施打追加劑) 或 B 組 (3+1 針，4 個月後施打追加劑)，安全性部分，無與疫苗相關的嚴重不良事件，耐受性也良好。高端指出，一期臨床數據證實，若以原型株作為追加劑，對於變異株 Beta、Omicron BA.4\\/BA.5 仍有疫苗免疫效果，但變異株會降低疫苗效力；而以 Beta 株疫苗作為追加劑，效果比原型株更好，可顯著提升對武漢株、變異株 Beta、Omicron BA.4\\/BA.5 的中和抗體效價。高端表示，無論使用何種組合的追加劑，施打後都顯示追加劑可誘導免疫記憶反應，並對變異株產生更全面交叉免疫反應，結果與 mRNA 疫苗加強劑的表現一致。\",\"image\":\"https:\\/\\/cimg.cnyes.cool\\/prod\\/news\\/4944716\\/l\\/b7e81789d1ba4dd65ea99d33b5a88255.jpg\"}}',	'222.216.20.171',	'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/76.0.3809.87 Safari/537.36',	1662058107),
