(848,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"期交所訂「3+E」發展重點 客製化契約交易平台明年底前上線\",\"content\":\"期交所去 (2021) 年繳出亮眼成績單，總交易量達 3.9 億口，成長達 14.9%。為促進市場穩健成長，期交所董事長吳自心今 (1) 日宣布，擬定「3+E」發展重點：建置客製化契約交易平台、擴大店頭集中結算規模、推出期貨風控防衛機制 2.0、促進期貨業永續 (ESG) 發展。其中客製化契約交易平台預計明年底建置完成，期盼帶領期貨市場邁向新未來。首先，建置客製化契約交易平台部分，期交所總經理周建隆表示，為擴大市場參與，規劃建置客製化契約交易平台，預計明年底建置完成，屆時可提供交易人隨選服務，交易所需的契約規格，可彈性選擇契約到期月份、履約價格、到期結算方式等，提供多元交易服務。初步規劃客製化契約標的以股價指數、股票等股權類商品為主，未來將持續研議擴大適用商品範疇。第二是擴大店頭衍生性商品結算規模，提升國際能見度。周建隆表示，今年 7 月 25 日正式開辦店頭衍生性商品集中結算業務，推出結算會員自營交易自願性新臺幣利率交換契約 (IRS) 集中結算，目前有 11 家結算會員，結算部位餘額達新臺幣 176 億元。周建隆進一步指出，明年 6 月規劃推出客戶端及新臺幣無本金交割遠期外匯 (NDF) 集中結算，屆時無論是 IRS 或 NDF 的自營或客戶交易皆可集中結算，結算會員預計增加至 23 家。後續研議推出新臺幣無本金交割利率交換契約等，並持續積極爭取國外合格集中結算機構 (QCCP) 資格認可，吸引外資參與集中結算市場。第三個發展重點是推出期貨風控防衛機制 2.0，周建隆表示，為強化期貨市場風險控管機制，期交所、期貨商、交易人三方攜手合作，升級市場防衛機制，以增強市場穩健。期交所將所有商品納入動態價格穩定措施、買賣申報整批撤銷機制推廣至經紀商、推出斷線後刪單等；期貨商端強化夜盤風控機制，如日盤收盤後壓力測試、交易人帳戶風險提醒注意等功能。而在 ESG 發展方面，周建隆表示，期交所將建置期貨市場 ESG 資訊平台，建構期貨市場永續金融生態，協助期貨商導入永續治理架構，鼓勵期貨業者推動 ESG；建置期貨市場 ESG 資訊平台，可以提供交易人一站式查詢便利服務，強化資訊揭露，進一步推廣 ESG 交易概念，深化期貨市場永續發展。\",\"image\":\"\\/uploads\\/20220902\\/74c156c5ecc6cf862cedc8af6b3205c9.jpg\"}}',	'222.216.20.171',	'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/76.0.3809.87 Safari/537.36',	1662058273),
