(851,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"〈大同高層異動〉副董王金來真除兼任總座 打造企業控股大艦隊\",\"content\":\"大同 (2371-TW) 今 (1) 日宣布，副董事長王金來正式真除兼任大同新總經理，展望未來，他說，大同擁有跨產業事業優勢，將強化集團在電力、新能源、資通訊及消費產業與子公司協同，發揮綜效，進一步打造大同大艦隊。王金來在報告前以「個人榮耀、全力以赴」八個字開場，未來集團持續以創能、儲能、節能等三能作為發展的大方向不變，公司事業部中高階專業經理人流動性不大，且擁有穩定的向心力、生產力，擔任總經理後，將發揮溝通整合的長才，成為事業發展、經營的後盾。王金來進一步指出，大同已連五季獲利，未來將鞏固優化核心實力，現有九大事業部也將會整合優化成事業群，同時集團已是產業控股，子公司業務規模在大同財報占約 50%，未來除本業外，也將加強集團控股效益。當中包含規劃及評估華映除列、精英併表、大同智能擴展等，在創新策略下，大同將以成為國家及企業的數位與能源轉型推手作為集團目標。值得注意的是，王金來也身兼精英副董事長暨總經理，針對精英併入合併報表時程，雖然未給出明確時間，但強調大同仍會持續加碼持股，並適時請會計師評估是否具營運實質控制權，目前大同持股精英約 32%，8 月時董事會也通過擬在一年內以 10 億元額度內持續增持精英持股。王金來希望，母子公司營收獲利比維持 50:50，同步成長、價值轉型，進而讓大同成為穩定成長獲利的產業控股公司，確保全體股東與員工的最大利益。\",\"image\":\"\\/uploads\\/20220902\\/4a7c9ce3ef739330224b9afafe769390.jpg\"}}',	'222.216.20.171',	'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/76.0.3809.87 Safari/537.36',	1662058993),
