(854,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"〈碩天法說〉東南亞產能提升減輕銷美關稅壓力 菲律賓廠續擴產\",\"content\":\"不斷電系統 (UPS) 廠碩天 (3617-TW) 表示，隨著東南亞產能提升，美中貿易戰關稅對成本的壓力逐漸減輕，營運將走出逆風、獲利可望回升，也將持續擴充菲律賓廠產能。碩天表示，公司北美銷售比重高，加上品牌與代工性質不同，需自行吸收關稅、航運等費用成本，難以轉嫁。其中，2018-2022 年光關稅就占公司成本達 8%，導致營運也大幅受影響。不過，隨著碩天菲律賓廠產能爬升，加上部分外包給越南代工廠出貨，目前公司銷北美產品有 6 成由東南亞出貨，若以整體產能來看，東南亞比重已達 5 成。碩天表示，雖然菲律賓廠多了原料運輸成本，但當地人力與規模效益仍具成本競爭力，因此會持續擴充當地產能。\",\"image\":\"\\/uploads\\/20220902\\/bbb721c6b23562d5fccb9c6e468589c7.jpg\"}}',	'222.216.20.171',	'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/76.0.3809.87 Safari/537.36',	1662059236),
