(856,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"低軌衛星國家隊成形   昇達科 建漢大成長時代來臨\",\"content\":\"台股周四 (9\\/1) 收 14,801 點，下跌 293 點，成交量 2,305 億。因美限制 AI 晶片銷往中國，CPU 業者恐受波及，後續的半導體供應鏈將遇逆風，估矽智財、 ABF 載板、 網通交換器、 封測等可能受衝擊，以台積電 (2330-TW) 為首的相關個股受打壓，短線先停看聽，例如: ABF 載板三雄: 欣興 (3037-TW)、 景碩(3189-TW)、 南電(8046-TW) 今股價全躺平，轉為弱勢，這些類股處於風暴中心，未轉強之前，不輕易摸底方可持盈保泰!萬寶投顧陳子榕表示，不受美中貿易升級版的衝擊，主要有二大族群:一. 元宇宙族群: 威盛集團為首，威盛 (2388-TW) 昨日漲停創高，今日稍作拉回休息，後市仍看好: 王雪紅董座力排眾議為聯想電腦獨董，搶進中國元宇宙市場: 位速 (3508-TW) 、建達(6118-TW)、 驊訊(6237-TW) 成長空間大。光學族群也受惠蘋果於 2023 年推出 ARVR 頭盔式裝置，今日整齊劃一上攻，揚明光 (3504-TW)&amp;amp;amp;nbsp; 先進光(3362-TW) 收漲停創新高；這一波元宇宙相關個股，拉回承接沿路操作可說是順風順水，有低檔布局者，漲幅至今超過五成!二. 低軌道衛星族群: 目前位階仍低，剛剛發酵而已，建議放長線釣大魚全球的低軌衛星商機到底有多旺? 根據 Grand View Research 調查顯示，2023 年全球衛星產值達 3,083 億美元，且 2029 年低軌衛星發射國家佔比「美國」就高達 88%。目前全球四大低軌衛星營運商美國佔了兩家，分別是 Starlink 和 Amazon 底下的 Project Kuiper。數據顯示，明年全球將有 1328 顆低軌衛星會開始商轉，之後每年布建的商轉數量呈現大幅度增加，相關個股剛剛萌芽!萬寶投顧陳子榕強調，根據經濟部工業局指出，台廠可切入的商機有先進的通訊射頻與相列陣列天線技術、晶片設計高頻材料、基頻調變、追星控制等系統整合。台灣在資通訊產業具有優勢，衛星終端設備與元件供應，我國已有近 40 家業者切入 SaceX、Oneweb 等多家國際衛星大廠與地面元件供應鏈，預期將吸引更多業者投入。在目前的國際氣氛之下，美國通過晶片法案和烏俄戰爭星鏈一戰成名，相信未來在全球低軌衛星的供應鏈中，台廠將可站得一席之地。相關低軌衛星股，仍在初級萌芽階段，昇達科 (3491-TW)、台揚(2314-TW)、建漢(3062-TW)、華通(2313-TW) 、燿華(2367-TW) 等仍值得留意。指數再大幅拉回打第二隻腳，只要不破 14,545 點，就形成雙底。大盤利空測試，不破前低之下，仍選擇好股拉回來承接: 陳子榕更細心挑選值得投資人注意的三檔股票：建漢 (3062-TW)，建漢 7 月營收 6.06 億元，月減 2.7%、年增 134.6%，前 7 月營收 25.61 億元，年增 13.2%，受惠缺料供應緩解，以及越南廠產能利用率提升，帶動 6、7 月出貨成長。下半年表現可望優於上半年，目標獲利逐步改善，建漢將持續優化營運，逐步擴大營收與事業版圖。合晶 (6182-TW)，近期半導體供應鏈進入庫存調整階段，但矽晶圓市況仍熱絡，合晶 8 吋產能維持滿載，且由於車用產品比重達四成以上，受到消費性電子市場需求轉差的影響有限，在 8 吋產能滿載且價格可望持續調漲，加上 6 吋價格仍在高檔，第 3 季營收可望持續走揚，下半年營運展望審慎樂觀。耀登 (3138-TW)，射頻暨測試廠耀登科技旗下耀睿科技，聯合中華電信合作建置的全台唯一 O-RAN 測試設備實驗室，拿到了現今最活躍的 5G 開放網路國際聯盟（O-RAN Alliance）認可的全球第一家第三方公正實驗室，堪稱台灣之光; 下半年的表現可望超越上半年。萬寶投顧陳子榕指出，現階段操作以選股為重， 陳子榕認為是元宇宙相關個股短線較有價差。陳子榕提到近期推薦的揚明光 (3504-TW) 漲幅高達 40%；采鈺 (6789-TW) 大漲 20%，此外，華通 (2313-TW) 也揚升 15%；燿華 (2367-TW) 短線 12%；晶心科 (6533-TW) 股價大漲 23%；之前陳子榕跟大家推薦的「滿漢大餐飆飆股」: 智原 (3035-TW)，這一波大漲 30%: 以及之前所推的 「天選之股」- 先進光(3362-TW) 今漲停並創高，大家滿滿收穫。陳子榕說到加入她的粉絲團好處非常多，除了飆股不漏接外，從週一至週日還有非常棒的資料可以看，現在就立即加入她的粉絲團! 索取「威盛第二」。\",\"image\":\"\\/uploads\\/20220902\\/f70bcf9b461416e604d2b385c91f1554.jpg\"}}',	'222.216.20.171',	'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/76.0.3809.87 Safari/537.36',	1662059538),
