(858,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"保瑞完成併購安成藥業 晉升國內產能最大藥業集團\",\"content\":\"保瑞 (6472-TW) 今 (1) 日宣布，正式併購安成國際藥業，晉升為國內產能最大的藥業集團，保瑞董事長盛保熙表示，未來安成將聚焦於研發與國際授權銷售，藉由安成藥品研發優勢及製造技術，整合保瑞旗下 CDMO 一條龍服務，可望大幅帶動保瑞營運、獲利上攻。保瑞表示，併購安成後，將擁有更完整的產品開發與製程研發技術，並新增眼藥水劑型佈局更完整的劑型生產線，成為更具競爭優勢的國際 CDMO，安成則可利用保瑞量產能力，擴大安成旗下美國學名藥出貨，降低成本並擴大市占率。另外，在藥品經銷與授權部分，保瑞指出，安成將與跟保瑞聯邦進行階段性整合，建立全球化銷售團隊。法人指出，安成加入保瑞後，除了既有產品外，未來也將開發新品項，持續挹注營收，保瑞在 CDMO 量能整合與藥品經銷授權雙引擎帶動下，可望持續交出亮眼成績。\",\"image\":\"\\/uploads\\/20220902\\/87f5c4eacab3f9ed653480e25685a3c3.jpg\"}}',	'222.216.20.171',	'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/76.0.3809.87 Safari/537.36',	1662059872),
