(861,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"籌碼大師的操盤日誌 － 萬五失守 中小型股仍是面重心\",\"content\":\"聯準會官員再度「放鷹」、台海緊張局勢持續升溫、惠普和 Seagate 下修財測成科技股賣壓導火線，美股四大指數昨日開高後狹幅震盪，尾盤各類股賣壓增強，四大指數連袂收黑，延續第四個交易日跌勢。美股創下 7 年來最差勁的 8 月份表現，標普 8 月跌幅 4.2%，道瓊月跌達 4.1%，那斯達克月跌 4.6%，費半 8 月重挫近 10%。盤前日韓股市均以低盤開出，再加上美股電子盤也持續走低，台股開盤後即壓力沉重，權值股紛紛見到急挫拉回，尤其是盤前傳出深圳將進入準封城狀態，這讓多檔有在深圳設廠的電子股開盤都跳空急跌，尤其是 ABF 三雄，除了南電之外都出現破底的走勢，在接近十二點時，新聞媒體報導成都將進入封城狀態，也讓指數跌幅進一步擴大，所幸在 12 點半後逢低買盤介入，跌幅略為收斂。大盤終場下跌 293.58 點，收在 14801.86 點，成交量 2305.36 億元。櫃買指數終場下跌 2.84 點，收在 196.53 點，成交量 780.46 億元。櫃買市場雖然也下跌 1.42%，但相較集中市場下跌近 2%，明顯強勢許多。中小型個股是本波主流，籌碼強勢股仍會走自己的路。操作上，要汰弱換強，或是汰弱留現金，而不是抱著賠錢的弱勢股等解套。強勢股，如今日平台整理型態突破的先進光 (3362-TW)&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp; 光學鏡頭廠先進光 (3362-TW) 公布第 2 季稅後純益 1.24 億元，季增 16%，為單季新高，每股純益 0.88 元。上半年稅後純益 2.3 億元，每股純益 1.69 元，較去年同期的 0.02 元大增。先進光為筆電鏡頭龍頭，第 2 季營收 10.29 億元，為歷史次高，季增 5.3%。儘管近期面臨品牌及下游客戶修正庫存，但先進光正向看待下半年營運，隨著新作業系統上市，對於生物辨識需求升溫，IR 鏡頭增加，雖然 NB 市場有下修，但鏡頭需求不減反增，下半年營運不看淡，今年整體營運也會優於去年。以及本欄在周二 (8\\/30) 介紹的：高力 (8996-TW) 與宜特 (3289-TW)熱交換大廠高力 (8996-TW) 在主力客戶 Bloom Energy 7 月起燃料電池 Hot Box 新訂單認列，加上歐洲俄烏戰爭導致天然氣供應短缺，板式熱交換器出貨看好，在手訂單能見度達半年，熱能產品、板式熱交換器二大產品線成長動能明確，7 月營收 2.59 億元創下歷史新高。Bloom Energy 為高力熱能產品長期主力客戶，去年底 Bloom Energy 獲韓國 SK 集團 45 億美元氫燃料電池設備和服務訂單，預估 500MW 產能，將有 1 萬顆反應爐關鍵零件 Hot Box 需求，其單價約 1 萬多美元，高力表示，公司作為其全球二大供應商之一，未來三年訂單無虞，7 月起已開始出貨並認列營收，交貨數量可望逐季成長。此外，高力另一項主要產品板式熱交換器，在全球擁有 5％以上市占率，為全球前五大供應商，由於歐洲地區因俄烏戰事導致天然氣供應短缺、尋求代替能源，帶動熱泵加溫器取代天然氣鍋爐趨勢，推升板式熱交換器出貨成長，去年已有 20％高年增率，今年上半年在高基期及歐元貶值下，仍有 10％成長，高力主攻客製化、小眾的利基市場，目前訂單能見度長達六個月。電子驗證分析企業宜特 (3289-TW) 因客戶委案訂單持續不斷，挹注單月營收連三月創新高；與 2021 年同期相比，增加 22.35%，累計前 7 月營收已達新台幣 21.07 億元，年增 18.17%。宜特表示，7 月合併營收續創新高，來自於車用晶片驗證、先進製程、先進封裝、第三代半導體、HPC 與雲端伺服器等材料分析 (MA)、故障分析 (FA)、可靠度驗證 (RA) 委案需求推進，特別是，宜特投入的材料分析 (MA) 設備陸續到位開出產能，擴產效益逐步顯現，帶動宜特連續三個月合併營收攀峰創新高。這三檔都是技術面遠遠超越大盤的強勢股，而強勢股的操作，只要 10 日均線未有效跌破，波段持續抱牢。10 日均線也在季線之下，且股價又在 10 日均線之下的，屬於弱勢股。10 日均線也在季線之上，且股價又在 10 日均線之上的，即為強勢股.抽出弱勢股的資金，轉進強勢股，即『汰弱換強』，操作才會有效率!\",\"image\":\"\\/uploads\\/20220902\\/1d998146e1b8765fa5fa9c5671f5c697.jpg\"}}',	'222.216.20.171',	'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/76.0.3809.87 Safari/537.36',	1662060798),
