(870,	1,	'admin',	'/houtai.php/news/edit/ids/11?dialog=1',	'财经新闻 / 编辑',	'{\"dialog\":\"1\",\"row\":{\"title\":\"外資大舉提款台積電及金融股 逆勢加碼面板雙虎\",\"content\":\"台股今 (1) 日在電子權值股壓盤走弱下，終場大跌 293 點，收在 14801 點，不僅跌破萬五，也再度失守所有均線，三大法人合計賣超 475.4 億元，其中，外資狂砍 332.47 億元，狙擊台積電、金融族群，但大舉搶進面板雙虎，反觀內資則持續力挺台股，投信連 50 買再刷紀錄。三大法人動向，外資今日大賣台股 332.47 億元，寫下 6 月 14 日以來、近 59 個交易日賣超金額最大量，投信則連 50 買，續買超 6.05 億元，自營商則與外資同站在賣方，今日賣超 148.97 億元，合計三大法人賣超 475.4 億元。期貨操作方面，外資今日大舉減碼 7231 口多單，多單未平倉口數降至 6059 口，投信則加碼 617 口空單，空單未平倉口數達 8442 口，自營商則由空翻多，加碼&amp;amp;nbsp; 3315 口多單，多單未平倉口數達 427 口。外資大砍台股 332 億元，鎖定電子權值、金融股調節，前十大賣超均破萬張，光金融股就占 4 檔，其中，新光金、中信金各有 34117、24864 張，分居一、二名，台積電也遭砍 18602 張，提款金額逾 91 億元，其他還包含國泰永續高股息、玉山金、鴻海、台新金、國泰智能電動車、力積電、欣興等。買超方面，外資回頭買超面板雙虎友達、群創，今日買超 15285 張、7242 張，躍居前二位，長榮航、元晶也各有 6858 張、6251 張，其他則依序為燿華、中天、統一實、高力、智擎、神隆等。投信操作上，今加碼元晶 7714 張最多，友達也有 5130 張居次，其他還包含華航、仁寶、英業達等，至於賣超方面，則大砍 ABF 三雄，欣興 4708 張居冠，景碩、南電也各有 2845 張、1143 張，華通也有千張以上。\",\"image\":\"\\/uploads\\/20220902\\/a860979ef4d279639c61a77305e589fe.jpg\"},\"ids\":\"11\"}',	'222.216.20.171',	'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/76.0.3809.87 Safari/537.36',	1662062373),
