(930,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》IDC二度下修 今年智慧手機出貨 估12.7億支\",\"content\":\"【時報-台北電】景氣好差，市調機構IDC二度下修今年全球智慧型手機出貨量，由6月的13.1億支、下修至目前的12.7億支，年減幅度也放大至6.5％。IDC表示，二度下修主因為破紀錄的通膨、地緣政治緊張均大幅抑制消費力，然而800美元以上高價機種卻不畏通膨，預估占比將逆勢增加4個百分點，也因各項成本激增，IDC預期全年手機平均出貨單價將上揚6.3％。去年下半年智慧型手機、尤其低價機種出貨量飽受缺料影響，今年不缺料，卻面臨俄烏戰爭帶來歐洲需求下滑，隨之而來的高通膨更影響買氣，前五大手機品牌中的三星、OPPO、vivo多在第二季大幅減少產量與零組件訂單，小米更早自第一季開始調整。也因此，IDC在6月初調降今年智慧型手機出貨量預估，成長性由年增1.5％、下修至年減3.5％之後，三個月內再度調降至年減6.5％，出貨量預估值則由6月的13.1億支、下修至目前的12.7億支，下修幅度為3.05個百分點。雪上加霜的是，IDC表示，今年第二季手機平均單價已經比去年同期大增10％，全年平均單價上揚幅度也有6.3％。即使通膨影響甚巨，但越貴的手機買氣似乎越不受通膨影響，IDC預期，800美元以上超高價機種今年出貨量不僅將逆勢成長，市場占比也將比去年增加四個百分點、至16％，而超高價機種逆勢上揚的助力之一就是折疊手機，今年出貨量有機會年增70％、至1,350萬支，而IDC更預期今年蘋果手機出貨量有機會年增0.5％，即使iPhone在2026年之前平均單價都超過950美元。相較之下，IDC表示，今年Android陣營手機出貨量恐比去年大減8％，尤其400美元以下低價機種壓力最大，以200美元以下價位手機為例，第一季出貨年減22.4％、第二季年減16.5％。(新聞來源 : 工商時報一吳筱雯／台北報導)\",\"image\":\"\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662180437),
(931,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》失守100美元 鐵礦砂跌至九個月新低\",\"content\":\"【時報-台北電】大陸疫情復燃，深圳和成都相繼淪陷又封城，市場隱憂燈號亮起，導致國際鐵礦砂原料價格重挫，跌破每噸100美元整數關卡，創逾九個月來新低，恐衝擊第四季鋼市傳統旺季。中鋼董事長翁朝棟出面信心喊話，強調這是短暫波動現象，不必驚慌。翁朝棟指出，大陸將於10月16日召開20大會議，將適時公布未來五年經濟計畫，預期將會釋放許多大利多的消息來挽救經濟，屆時市場需求動能就會跟著起來，值得市場觀察。對於澳洲鐵礦砂行情再度走跌，翁朝棟認為，深圳、成都因疫情嚴峻相繼封城，多少影響市場需求，尤其對電子業的供應鏈影響較大，但對鋼鐵業的影響有限。澳洲鐵礦砂每噸跌破100美元，屬於短暫波動現象，因鐵礦最近的波動區間都在90至100美元，甚至120美元間游動，所以這次再度回檔到95美元，相當正常，不必驚慌，也不致衝擊到第四季鋼市傳統旺季。長期而言，仍持續看好鋼市前景。國際鐵礦1日再度反轉重挫，每噸跌破100美元價位。據了解，主要因成都實施封控，市場擔憂大陸經濟再遭衝擊，致使鋼價走弱，拖累鐵礦砂價格重挫。根據外電報導，鋼市進入「金九」旺季第一天，澳洲62％品位粉礦運往大陸的價格，單日大跌4.7美元，每噸滑落到95.45美元，單是本周四個交易日就大跌9.75美元，跌幅9.3％。鐵礦已來到去年11月22日95.25美元以來的新低。鐵礦8月共大跌14.35美元，跌幅12.5％。鋼鐵專家指出，鐵礦價反轉重挫，主因大陸疫情再起，大陸黑色商品同跌，現貨鋼價也欲漲乏力，呈現小幅漲跌態勢。此外，近日來國際鎳價也重挫，1日期貨價盤中最高價為每噸21,115美元，最低20,275美元，上下震盪840美元，終場收20,311美元。(新聞來源 : 工商時報一林憲祥／高雄報導)\",\"image\":\"\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662180617),
