(1053,	1,	'admin',	'/houtai.php/news/edit/ids/12?dialog=1',	'财经新闻 / 编辑',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》IDC二度下修 今年智慧手機出貨 估12.7億支\",\"content\":\"【時報-台北電】景氣好差，市調機構IDC二度下修今年全球智慧型手機出貨量，由6月的13.1億支、下修至目前的12.7億支，年減幅度也放大至6.5％。IDC表示，二度下修主因為破紀錄的通膨、地緣政治緊張均大幅抑制消費力，然而800美元以上高價機種卻不畏通膨，預估占比將逆勢增加4個百分點，也因各項成本激增，IDC預期全年手機平均出貨單價將上揚6.3％。去年下半年智慧型手機、尤其低價機種出貨量飽受缺料影響，今年不缺料，卻面臨俄烏戰爭帶來歐洲需求下滑，隨之而來的高通膨更影響買氣，前五大手機品牌中的三星、OPPO、vivo多在第二季大幅減少產量與零組件訂單，小米更早自第一季開始調整。也因此，IDC在6月初調降今年智慧型手機出貨量預估，成長性由年增1.5％、下修至年減3.5％之後，三個月內再度調降至年減6.5％，出貨量預估值則由6月的13.1億支、下修至目前的12.7億支，下修幅度為3.05個百分點。雪上加霜的是，IDC表示，今年第二季手機平均單價已經比去年同期大增10％，全年平均單價上揚幅度也有6.3％。即使通膨影響甚巨，但越貴的手機買氣似乎越不受通膨影響，IDC預期，800美元以上超高價機種今年出貨量不僅將逆勢成長，市場占比也將比去年增加四個百分點、至16％，而超高價機種逆勢上揚的助力之一就是折疊手機，今年出貨量有機會年增70％、至1,350萬支，而IDC更預期今年蘋果手機出貨量有機會年增0.5％，即使iPhone在2026年之前平均單價都超過950美元。相較之下，IDC表示，今年Android陣營手機出貨量恐比去年大減8％，尤其400美元以下低價機種壓力最大，以200美元以下價位手機為例，第一季出貨年減22.4％、第二季年減16.5％。(新聞來源 : 工商時報一吳筱雯／台北報導\",\"image\":\"\"},\"ids\":\"12\"}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662208210),
