(1056,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《台北股市》外資單周賣超台股逾800億 選前借「鷹」洗盤？\",\"content\":\"【時報記者任珮云台北報導】聯準會鷹派發言，加上熱錢持續撤出，讓台股本週週線連二黑，全週下跌605.4點，週線跌幅-3.96%，外資連續第5週站在賣方，本週賣超金額再擴大至880.11億元，改寫6月20日當週以來最大單週賣超金額，也使得今年來外資累計提款金額再推高至1.13兆元。\\r\\n\\r\\nPGIM保德信科技島基金經理人孫傳恕指出，近期台股走勢再度轉弱，主要是受到聯準會強硬的升息態度影響，股市評價面下滑，加上外資賣超台股金額持續擴大，熱錢持續撤出，多頭信心受到壓抑，使得台股再度落於各天期均線之下。另外，隨著中秋節將至，根據歷年統計，中秋節前台股賣壓較為沉重，待中秋過後指數較能漸入佳境，且蘋果發表會即將於下週登場，有望替蘋概股題材加溫。\\r\\n\\r\\n安聯投信台股團隊表示，目前台股本益比下修至10.5倍左右、近十年低點，殖利率則來到十年高點；若就從價值面來看，台股資金去化效益逐步浮現，台股下檔風險也開始收斂。\\r\\n\\r\\n日盛精選五虎基金投資團隊指出，台股經過第三季落底後，研判美國CPI見高，台股有機會結束中期回檔格局，預期企業營運及獲利持續成長，帶動台股反彈。選股上更要選擇獲利成長的公司，靜待庫存去化及淡季過去。建議投資人可趁勢採定時定額或分批方式布局台股基金，迎接台股築底反彈行情。\\r\\n\\r\\n安聯投信台股團隊表示，由於升息效應、高通膨、以及扮隨氣候變遷等帶來的高電費開銷等，勢必將排擠消費，因此接下來可先關注iPhone銷售狀況，再來判斷終端消費市場氛圍。\\r\\n\\r\\n孫傳恕表示，隨著台灣與美國的選情加溫，在政策與籌碼做多之下，有利於選舉行情發酵，加上根據歷年美國期中選舉的股市表現，在該年10、11月美股上漲走勢居多，對於提振台股整體投資情緒有加分作用。\",\"image\":\"\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662208308),
