(1062,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"台積電創一個半月新低 台股失守14700點\",\"content\":\"&amp;nbsp;2022年9月2日 週五 下午1:59台股在台積電、聯發科及航運股震盪走低下，終場下跌128.82點跌幅0.87%，收在14673.04點，成交值新台幣2311.11億元。加權指數失守14700點整數關卡，周線連二黑權值股台積電今天終場下跌5.5元，以485元作收，跌幅1.12%，創下7月14日以來波段低點；聯發科下挫28元，收在620元，跌幅4.32%。鴻海終場以平盤107.5元作收；世芯-KY、宏達電表現強勢，分別上漲逾8%及6%。航運類股表現疲軟，貨櫃三雄長榮、陽明、萬海收盤跌幅皆超過6%。生技類股今天相對抗跌，類股收盤漲幅2.22%。\",\"image\":\"\\/uploads\\/20220903\\/800a80fd32af6086d637e09b431a5a45.webp\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662208800),
