(1065,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》SCFI跌破3,000點 美西線最慘\",\"content\":\"【時報-台北電】貨櫃海運運價暴跌震撼市場，9月首周寫下疫情來最大跌幅，2日上海出口貨櫃運價指數SCFI一舉跌破3,000點，跌幅最重逾22％的美西線，40呎櫃運價驚見3字頭，短短一周接連失守5,000、4,000美元等二大關卡，地中海線20呎櫃運價也失守5,000美元關卡，美東線剉咧等，下周40呎櫃面臨8,000美元保衛戰。\\r\\n\\r\\n法人示警，美西線跌跌不休，中小型航商或是高價租船恐將面臨損益邊緣，大陸清零停產重啟，加上歐美庫存偏高需要時間消化，預估貨量仍將持續下探。\\r\\n\\r\\nSCFI最新報價下跌9.72％至2,847.62點，已連續12周下跌，回測2021年4月中低點。據統計，SCFI指數從歷史高點下跌至今逾44％，其中美西線40呎櫃運價腰斬、跌幅逾51％最多，其次歐洲線20呎櫃運價下跌逾45％，美東線每40呎櫃下跌逾30％。\\r\\n\\r\\n海運三大聯盟持續調控艙位，減班護「價」，貨代業者透露，9月2M聯盟歐洲線減班10％、THE聯盟減班18％。航商在第四季淡季會有減班措施，今年提早一個月，除了例行性安排船舶檢修，當然有支撐運價的考量。\\r\\n\\r\\n貨代業者直指，運價積弱不振，就是「貨太少、船太多」，貨量急縮，新船卻持續下水。對運輸業來說，重要指標是數量，通膨讓消費者購買力減弱，再者，人們在非貨櫃運輸的食品、燃料花費增加，而服裝家具、電子產品等傳統貨櫃運商品卻減少。\\r\\n\\r\\n海運現貨價跌跌不休，貨櫃三雄2日股價跌勢沈重，長榮失守80元關卡，下跌7.54％、收79.7元；陽明跌7.42％、收71.1元，面臨70元保衛戰；萬海也失守80元，下跌6.81％、收78元。長榮、陽明成交量分別近12萬張、逾10萬張，居上市公司前五名。\\r\\n\\r\\n航商、貨代業者表示，歐美市場通膨罩頂，需求不振、庫存積壓，隨貨源減少，船公司填艙壓力引發殺價搶貨現象，歐美主要港口罷工、壅堵程度，將決定運價跌勢速度。接下來就看庫存消化、通膨緩解，是否有季節性需求、一般性商品補貨，支撐運價。(新聞來源 : 工商時報一邱莉玲／台北報導)\",\"image\":\"\\/uploads\\/20220903\\/6d3fe9670cae049c55c9d2dcadb21734.jpg\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662209052),
