(1082,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》16檔DNA股 搶賺機會財\",\"content\":\"【時報-台北電】美國聯準會（Fed）主席鮑爾鷹式升息，強力對抗通膨，台股遭受池魚之殃，外資今年賣超逾兆元，每日成交量縮至約2,000億元。市場法人表示，資金動能不足大型股難有表現，此時價差交易當道，配合貶值受惠、政策支持，與產業前景最看好的車用電子三題材，篩選包括中興電等16檔DNA概念股，有望提升獲利的機會。專家進一步說明，所謂的DNA概念選股法，D指的是Depreciation，即新台幣貶值受惠股，如紡織成衣、製鞋、自行車等，因新台幣貶值兌美元匯率跌破30.5元關卡，外銷產業受惠匯兌收益的挹注。N是National Policy，即政策支持的公共建設、國防工業、低軌衛星等產業。至於A，則是指Automotive，意指汽車及其零組件的企業，尤其國產電動車才剛開賣就封盤，潛在的龐大需求相當可觀。第一金投顧董事長陳奕光指出，美國加速升息環境下，美元走強，新台幣走弱，台股指數上攻動能有限，基本面又存在調庫存壓力，個股操作宜採價差操作，而中小型題材股較有機會財可期。他指出，綠能、風電等替代能源，在政策加持下，未來供電比重持續增加，較不受景氣波動影響。台電1,500億元的供電穩定及汰舊換新措施，將帶動儲能、重電等相關供應鏈商機。此外，國防預算創新高，同屬政策加持的船艦、飛機，也迎來汰舊換新、升級需求，相關供應鍵在全球景氣下修下受衝擊程度亦小。群益投顧副總裁曾炎裕認為，目前留在市場內的資金，交易熱區集中在電動車、車電、能源等領域，擁有題材與量價變化的個股，才有力量驅動股價上漲。台新投顧副總經理黃文清指出，本周為中秋節連假前的交易日，預期指數表現空間受限，等待節後，有望看見資金回籠。元富投顧總經理鄭文賢表示，美國科技股和半導體面臨下降循環，包括PC、手機、工業市場下滑，也干擾台灣電子股反彈走勢，加上大陸動態清零，四川、上海乾旱缺電，造成停工，電子產業雪上加霜，美中晶片大戰也上演，對科技股的壓力更大。(新聞來源 : 工商時報一李娟萍／台北報導)\",\"image\":\"\\/uploads\\/20220904\\/f66eabc41088b14616b9e39cf1d15051.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662260090),
