(1093,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》歐洲央行預期升息3碼\",\"content\":\"【時報-台北電】歐洲央行（ECB）將在8日召開貨幣政策會議，全球關注ECB的升息幅度。基於通膨前景不斷惡化，該央行官員近來頻頻發表鷹派談話，市場已反映升息2碼的預期，9月初出爐的8月通膨率再創新高後，包括高盛在內的多家投行預估，本次例會將升息3碼。ECB7月例會以2碼揭開11年來的首次升息循環，直到不久前，外界還預期本次亦可能升息2碼，但能源價格暴漲不斷推高通膨，也讓央行官員立場逐漸轉向鷹派。官員擔心，即便是長期通膨預期也可能超出歐洲央行2％的目標，意味著對央行打擊通膨的能力失去信心。荷蘭央行總裁諾特（Klaas Knot）與愛沙尼亞央行總裁穆勒（Madis Muller）皆表示，9月例會至少應該討論升息3碼，而德國央行總裁納格爾（Joachim Nagel）主張迅速行動，稱先快後慢的「前置升息」（front-loading）有其好處，不能因為擔心潛在經濟衰退而裹足不前。歐洲央行管理委員會成員施納貝爾（Isabel Schnabel），以及法國央行總裁戴加洛（Francois Villeroy de Galhau），亦要求強有力或大幅升息。歐元區8月通膨升抵9.1％，再創歷史新高，不久後便可能達到兩位數。高盛指出，基於8月通膨率高於預期，加上官員的鷹派言論，預期歐洲央行管理委員會9月將升息3碼。此外，凱投宏觀、摩根大通、美國銀行（BoA）、瑞典北歐聯合銀行（Nordea Bank）和荷蘭合作銀行（Rabobank）等，皆預測升息3碼。摩根大通表示，越來越多官員支持強力回應物價飛漲，8月通膨數據讓他們更有理由積極升息。(新聞來源 : 工商時報一顏嘉南／綜合外電報導)\",\"image\":\"\\/uploads\\/20220904\\/c5d185d838c03aa2a4e9afa448ff80cc.png\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662260636),
