(1097,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》提振油價 OPEC＋擬討論減產\",\"content\":\"【時報-台北電】石油輸出國家組織與其盟國（OPEC+）5日將召開會議討論油產政策。鑒於OPEC龍頭沙烏地阿拉伯上月曾拋出減產議題，據消息來源透露，與會官員將不排除討論降低產能以支撐油價。受可能減產利多激勵，布蘭特油價2日盤中曾一度升破95美元，但隨後擔憂全球經濟成長趨緩與中國再度封城抗疫，導致漲幅受限，終場布蘭特油價僅小漲1％到每桶93.28美元、美國西德州期油也溫和走高0.74％到87.25美元。兩大指標油價周線仍舊收黑，跌幅約為6.1％與4.6％。據熟悉OPEC的三名消息人士指出，油市供給依然吃緊、加上擔憂此時提出減產恐將引發政治反彈，OPEC＋在這次會議料將繼續維持產出配額不變。但也有數名官員提到，由於油市前景不明，並不排除進行減產以拉抬油價。近來美國聯準會與其他主要央行為打擊通膨大幅調高利率，導致全球經濟陷入衰退風險大幅攀升，加上中國防疫封城，也對石油需求造成衝擊。受此影響，布蘭特油價已從今年高點的120美元大幅回落到每桶93美元附近。眼見油價再度走跌，沙烏地阿拉伯能源部長阿卜杜拉齊茲親王（Abdulaziz bin Salman）上月曾拋出減產議題，聲稱油價已與實體市場脫節，無法反映供應基本面，並暗示在9月會議將討論減產以平衡供需。沙國減產想法也獲得多個會員國的力挺，阿拉伯聯合大公國與阿曼都表態將支持OPEC+努力維持市場穩定的行動。另外伊朗與美國的核協議雖然仍在進行談判，但OPEC+還憂心一旦兩造達成協議，伊朗原油將重回油市，讓原油日產量增加1百萬桶、約占全球供給的1％。OANDA高級市場分析師厄蘭（Craig Erlam）指出，伊朗和美國之間的核談判若在近期出現進展，預料將對油價帶來很大下行風險。沙國似乎藉由發出減產，來警告將因應該情況的發生。(新聞來源 : 工商時報一蕭麗君／綜合外電報導)\",\"image\":\"\\/uploads\\/20220904\\/2dd45335719d40edb4b91987b675eeaa.png\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662261116),
