(1164,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《台北股市》焦點股-愛地雅\",\"content\":\"【時報記者郭鴻慧台北報導】自行車組車大廠愛地雅(8933)全球生產基地計畫擴廠與擴產，年產能將擴增3成，多頭攻勢凌厲，上週累計五個交易日股價漲幅高達27.1%。愛地雅2022年上半年稅後純益1.67億元，為去年全年度的2倍，EPS達0.56元，賺贏去年一整年，下半年進入自行車出貨高峰期，法人樂觀看待今年全年度的營運表現。愛地雅目前全球生產製造基地有四處，包括台灣台中廠、大陸東莞廠、歐洲波蘭廠、越南車架廠，生產基地皆有計劃擴廠與擴產，年產能可望增加3成，2024年產能可望衝破百萬台。愛地雅台灣廠目前年產能約25萬台，在擴產完成後，年產能將可提高到35萬台；大陸東莞廠目前年產能約36萬台，未來將把資源聚焦在車架的生產製造上；波蘭廠將加碼投資，預計將興建二廠，完工後兩廠年產能將由6萬台衝高到18萬台、產能提高3倍；至於越南廠第一階段將先接東莞廠車架外溢訂單，下階段計劃興建組車廠，年產能上看12萬台的組車廠。\",\"image\":\"\\/uploads\\/20220904\\/1b73911c7eba43001bc7ee75b85440e7.jpg\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662284395),
