(1168,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》強美元 日圓貶破140恐成常態\",\"content\":\"【時報-台北電】美國聯準會(Fed)「極鷹派」的貨幣緊縮方向，對全球金融市場的衝擊受各界高度關注。日本瑞穗金融集團瑞穗綜研首席經濟學家太田智之接受本報專訪時指出，美國處於「工資通膨螺旋向上」的邊緣，推高了服務業價格，但更應注意的是，真正的升息效應才要開始。美日利差第四季會拉大超過3個百分點，強勢美元對所有非美貨幣，帶來極大壓力，日圓兌美元匯率波動會很大，「衝到140元的上方，也不用太驚訝。」甫公布的美國8月非農就業人口，略低於市場預期，失業率則升至6個月來新高的3.7％，市場推估，Fed將維持現行激進升息步調。太田智之對此的看法是，聯準會主席鮑爾在全球央行年會中的講話，強烈反映對美國持續高通膨的危機感，9月升息3碼概率相當高，瑞穗預判，升息還會繼續，聯邦基準利率到年底將達到4％。日銀總裁黑田東彥曾公開回應美國的鷹派貨幣政策，他認為，日本持續貨幣寬鬆之外「別無選項」，肯定需要透過貨幣政策，來達到薪資和物價呈現穩定、甚至持續性揚升。太田智之對此表示，日銀認定近期物價上漲「只是進口價格上漲轉嫁使然」，不是持續型上漲，日銀態度上就不想調整利率，因此，日本和美國的利差，會在今年底進一步擴大，長期利率的利差將在3個百分點。太田智之並指出，日本原本就維持寬鬆貨幣政策，日圓兌美元容易偏貶，如今Fed堅定升息的腳步大步邁開，日圓更會持續貶值。日圓持續走貶，兌美元匯率在7月15日貶至138.97，8月1日一度回升到131.64，9\\/2，之後再度走貶至140.19 。太田智之分析，雖先前日圓貶值幅度已對今年至7月的升息有所反應，但Fed真正的升息是「從現在開始」，即9月之後及至明年，據此估測，美元兌日圓將會進一步貶值。瑞穗銀行的第四季平均價位估計約140元，然而，這段時間的波動會很大，短暫衝到140元上方都不必太驚訝。(新聞來源 : 工商時報一陳碧芬／台北報導)\",\"image\":\"\\/uploads\\/20220904\\/2a786255ed31b6ec522cc91464bbad48.jpg\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662284595),
