(1171,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》歐斷氣攪局 美股周線連三黑\",\"content\":\"【時報-台北電】美國就業報告利多消息不敵歐洲天然氣危機憂慮，美股2日開高走低，三大指數寫下周線連三黑紀錄。在股市動盪加劇之際，能源、防禦與高股息類股最受投資人青睞。道瓊工業指數2日下挫337.98點或1.07％，以31,318.44點作收；標普500指數亦下跌1.07％，收在3,924.26點，科技股雲集的那斯達克指數下滑1.31％，報11,630.86點。三大指數周線連續三周收黑，道指挫低2.99％，標指大跌3.29％，那指重挫4.21％。美國8月失業率上升略微緩解聯準會（Fed）持續激進升息的市場憂慮，激勵美股2日開盤急速拉高。然而俄羅斯國營天然氣公司Gazprom表示，俄國連接德國的北溪一號管線無法在3日回復供氣，歐洲能源危機雪上加霜，受此影響美股午盤反轉下跌，早盤漲勢全數回吐。Horizon投資公司投資組合管理部門主管希爾（Zach Hill）指出，俄國斷氣的消息掩蓋就業報告光芒，歐洲能源危機占據下午的市場焦點，拖累美股走勢。分析師亦指出，美國5日適逢勞動節休市，美股在3天連假前交投清淡，亦加劇股市波動。8月就業報告顯示，薪資成長低於預期，失業率由3.5％攀升至3.7％，意味著聯準會（Fed）前期快後期慢的「前置升息」政策，開始顯露成效。市場焦點接下來轉向9月中出爐的8月消費者物價指數（CPI），此為聯準會在9月20至21日貨幣政策會議前的最後一項重要經濟數據。聯準會主席鮑爾先前示警，央行不惜犧牲經濟成長也要對抗通膨，標指自8月中以來下挫9％，回吐部分夏季漲勢。在聯準會官員頻頻放鷹，美股波動加劇之際，日常用品、醫療保健和公用事業等產業相對抗跌，吸引投資人搶進。能源類股是今年股市的最大贏家，開年迄今累計大漲44％。值得一提的是，能源類股是標指2日唯一收紅類股，上漲1.81％。(新聞來源 : 工商時報一顏嘉南／綜合外電報導)\",\"image\":\"\\/uploads\\/20220904\\/c5aa4ccb42243219618dcc2d8ca5e458.jpg\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662284661),
