(1255,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》PC市場冷 全球出貨量衰到明年\",\"content\":\"【時報-台北電】PC市場明年續跌，品牌廠全面緊縮新品推出，HP（惠普）日前並預告消費和商業需求在下一季度裡需求依然疲軟，加上目前通路庫存水位仍高，接下來將以更激進的促銷策略以加速清庫存，這也將使得PC市場提前進入殺價促銷的價格戰。IDC預期消費者信心指數在後續的六個季度將持續惡化，導致消費性PC產品出貨量今、明年度持續衰退，其中2022年度估將下滑近1成後，2023年再以低個位數走跌，並拖累全球PC出貨量由今年度的3.05億台， 跌至明年破3億、降至2.97億台。依HP甫公布最近一季（5～7月）的財報來看，PC業務再較上季明顯走滑，包括筆電產品營收季減達15％、桌上型電腦產品營收亦季減11％。對比去年同期，HP筆電出貨量更是大幅年減32％，不過因Chromebook機款比重大舉降低，營收年減幅收斂至10％。至於桌機產品則仍因有商用需求帶動，出貨量小幅年增1％、營收年增13％，不過受到總體經濟不佳影響，動能不若原先預期，HP亦透露，短期內不只消費性PC市場需求持續走弱，來自商用市場的訂單需求亦顯疲軟，恐在下一個季度仍呈現衰退趨勢。HP的看法與先前陸續發布季報的Dell（戴爾）、Lenovo（聯想）及NVIDIA（輝達）等業者，對PC市場需求看淡一致，同時對於現階段手上存庫偏高、須加速去化調整的策略亦與市場有共識，各業者並將自該季起採行更積極的做法，以大幅降低庫存水位。進入下半年以來，PC品牌廠多已明顯收斂在消費型機款的升級新品數量，多為延續既有機款規格變化。若有新發布的新品，則多聚焦在高階、或與市場主流具明顯差異化的產品，如聯想與華碩接連端出的OLED可摺疊螢幕筆電ThinkPad X1 Fold、ASUS Zenbook 17 Flod OLED，與宏碁延伸環保系列的Chromebook Vero 514等。IDC認為，消費PC市場的需求趨於飽和，加上全球景氣不佳、通膨等影響，將使得消費PC市場需求直到明年底持續萎縮，至2024年才出現反彈。IDC亦再度下修對今年度全球PC市場出貨預測值，其中消費PC估將年減9.9％、降至2.65億台，企業端採購的PC出貨量亦將年減1.6％、低於0.58億台，含括教育及政府部門採購的PC出貨量則年減2成以上、為0.69億台。(新聞來源 : 工商時報一翁毓嵐／台北報導)\",\"image\":\"\\/uploads\\/20220905\\/80aa7189e2878088badb36749bb6fc7d.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662341192),
