(1257,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》券商公會理事長陳俊宏：創新、數位力齊發打造新市場利基\",\"content\":\"【時報-台北電】券商公會第九屆會員大會7月底完成改選，由元富證券董事長陳俊宏擔任理事長一職，身為熟稔證券、產業長年發展的沙場老將，他直言，創新及數位力展現，會是全體證券商未來重要發展關鍵，券商公會將積極扮演平台溝通角色，藉由新業務拓展，作大證券市場版圖。觀察近年台灣證券市場變化，陳俊宏樂觀認為自金融風暴之後，台股體質良好，動能恢復快速，可說是已經旺了十年以上，包括外資大舉進駐，近年還有台商資金回流，當沖占比一度超過4成，熱度堪稱比肩美股，都可以看出市況相當活絡，且已走向更加成熟的階段。陳俊宏說，隨著金融科技（Fintech）蓬勃發展、普惠金融議題發酵，以及主管機關不斷鬆綁交易制度及開放業務，讓證券商有機會「借力」數位科技，進行業務開拓及客戶關係維護，同時也能夠擴大業務規模及業務範疇，發展新市場利基。因此，甫接下券商公會總舵手一職，陳俊宏就已定調「創新業務」及「數位金融應用」將是證券業未來重要方向，可望迎來下個「黃金十年」。未來券商公會會積極在此兩大方向上推動相關業務，協助證券商提升業務經營空間，以及跨業競爭力度，增進全體券商共同利益。創新業務 讓企業融資更順陳俊宏指出，針對創新業務，券商公會目前除了已經在推動提升交割專戶分戶帳使用效益、縮短盤中零股交易撮合間隔時間、開放複委託融資等制度之外，也正在研議上市櫃公司發行新股時，券商可以提供員工及原股東股款繳納資金融通服務，打通企業籌資環節，提升證券商投行業務服務價值。另外，在客戶融通資金方面，朝向總歸戶的概念，協助證券商強化及整合對客戶各項資金融通業務的風險管理。在數位金融應用方面，陳俊宏建議，可以加速推動證券商遠距服務可適用身分認證機制，以及擴大客戶於線上進行交割款帳戶設定、出入金及扣款應用模式，提升證券商多元攬客能力，並能享受由數位科技所帶來的紅利。建立資安標準 防堵詐騙此外，台股去年交易熱絡，在整體市場量能及投資人數大幅擴增之下，導致資訊安全及金融詐騙等問題層出不窮，造成投資人困擾。陳俊宏指出，券商公會期望能扮演橋樑，有效集結主管機關、金融周邊單位、證券商及第三方資訊業者力量，共同建立一套資安管理標準並全面納入監管，做好全方位資安防護，讓台灣證券市場朝更健全的方向發展。力推ESG 實踐社會公益而在追求獲利之外，陳俊宏認為，證券商也應該進一步發揮實踐社會公益的角色，積極推動普惠金融投資。可以藉由推展線上、智能、小額、多元商品及教育等多面向投資友善工作，擴大金融服務覆蓋對象，提供投資人越來越多元的證券商服務。未來將邀請證券同業共同推行ESG，一起積極投入環境、社會和公司治理、擴大企業和產業影響力以達到共好。(新聞來源 : 工商時報一陳昱光、方歆婷／台北報導)\",\"image\":\"\\/uploads\\/20220905\\/900e2c7b085cebd6b21dc67921b47279.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662341667),
