(1259,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《各報要聞》廈門通令民用無人機限飛 明令9月12日前未經審批不能起降\",\"content\":\"【時報-台北電】「廈門公安」微信公眾號3日指出，廈門市公安局為加強投資貿易洽談會舉辦期間的無人機等民用小型航空器管理，從9月3日至12日進行管制，未經審批不得起降。由於金門地區連日來遭大陸民用無人機侵擾，甚至遭我方金門守軍示警、擊落，因此該通告特別受到矚目，有大陸網友直言，此舉將使從廈門飛抵金門的無人機行動被迫暫停。總統下令採強力措施 反制無人機近期台海情勢變化下，大陸沿海出現多次民用無人機飛抵金馬等離島，甚至拍攝當地駐守部隊。蔡英文總統曾於上月30日表示，敵軍愈是挑釁，就愈要冷靜，國軍自我克制，但不表示國軍不會反制，她下令：「國軍應適時採強力措施反制中共無人機」，金門守軍在1日首度開槍擊落大陸民用無人空拍機。金門守軍2日更在烈嶼貴山海灘發現以垃圾袋包裹的榨菜、滷蛋等食品。袋子上寫著「把最好的，吃不起的茶葉蛋和榨菜，都送給你們」，嘲諷過去某些台灣名嘴在政論節目曾說大陸人吃不起茶葉蛋與榨菜的爭議。金防部表示，依國防部「一點生變、連鎖反應、全面制變」指導，各據點官兵時刻監控，發現不明無人機時，執勤官兵立即回報並加強監視，待命班人員則運用干擾槍及7.62公釐口徑以下步槍實施防衛射擊。台海敏感時機 廈門通令引發聯想廈門官方3日發布的《通告》為無人機事件再添聯想。廈門市公安局與中國民用航空廈門安全監督管理局等單位指出，為確保第22屆中國國際投資貿易洽談會安全順利舉行，根據相關規定，要求對包含輕型和超輕型飛機、輕型直升機、滑翔機、三角翼、滑翔傘、動力傘等有人駕駛航空器；另對無人機、航空模型等無人駕駛航空器，以及熱氣球、飛艇、無人駕駛自由氣球、孔明燈、大型風箏等空飄物進行臨時性管理。該《通告》要求，從3日至12日止未經審批，任何單位和個人不得擅自在廈門起降民用小型航空器和升放空飄物，並對違反管制等行為，由有關部門依法處罰，構成犯罪更將依法追究刑事責任。該《通告》也強調，如是因緊急救援、氣象探測、人工影響天氣以及投洽會的宣傳，確需起降民用小型航空器和升放空飄物，應按照規定及時報請民航廈門安全監督管理局並會同相關部門審批。對於擊落大陸民用無人機一事，大陸國台辦發言人朱鳳蓮日前曾表示，民進黨企圖借機炒作、製造緊張氣氛、升高兩岸對立對抗是極其荒唐與可笑。此次廈門官方的限飛令，則帶有緩解的意味。我方國防部不予評論。金門地區在3日與4日未獲報有不明民用無人機的蹤影，但是國防部昨晚指出，至昨天下午5時為止，第一次公布偵獲1架軍用無人機，另有7架共機，其中有3架逾越海峽中線、進入西南空域，並有5艘共艦，在台灣周邊海空域活動，國軍運用任務機、艦及岸置飛彈系統嚴密監控與應處。金防部強調，射擊前將謹慎明辨，確認空間射角安全，再予以擊落，避免傷及民眾與其財產。烈嶼守備大隊吳士官長表示，據點官兵將依照國防部政策指導，時刻監控、反制，確維防區整體安全。(新聞來源：中國時報─記者吳泓勳、葉家瑋／綜合報導)\",\"image\":\"\\/uploads\\/20220905\\/047d2f3d518e83c942a4cec8a26aed86.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662341865),
