(1263,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《晨間解盤》現金為王 1族群下好離手(倫元投顧提供)\",\"content\":\"【時報-台北電】美股上周四早盤重挫、尾盤拉升收斂跌幅，技術線型留下長下影線，根據技術面分析，這是多頭抵抗的型態，說明美股短期的修正有可能暫告一段落，如矽智財族群，因為該族群的估值是台股中最高的、而且價格也高，這個族群是市場中大戶喜愛操作者，並非一般散戶就能夠推動，也就是說，大內資開始熱身了！其實盤面不只矽智財，另外市場性濃的個股也有點火，如跟車電相關的二極體、低軌衛星、蘋果派等，市場派動作開始積極，則有助於吸引短多人氣回溫。整體分析，目前是法人股弱、內資股強，因為法人股多屬於大型佔權值者，但必須美股配合不再重挫才行，否則一日行情的個股會變多；策略上保留適度現金部位，從長期看好的產業中尋找標的操作：以車電為主、向外擴散。(倫元投顧提供)\",\"image\":\"\\/uploads\\/20220905\\/7d2aa9fe632cc2ffd7ac67d45149d269.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662342166),
