(1265,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《台北股市》內資控盤 17檔人氣不墜\",\"content\":\"【時報-台北電】台股內資控盤，資金往中小型股集結，投信、中實戶及主力多頭勢力進場，維繫人氣的不墜。考量國安基金護盤及美股科技股波動劇烈，台股分析師建議資金往內資色彩濃厚的個股布局，包括元晶（6443）等17檔個股有撐。永豐投顧總經理李學詩認為，國安基金宣布進場護盤的7月低點到波段高點，反彈了1,547點，但是大病不可能即刻痊癒，目前全球仍受制於美國急速升息、企業高庫存、全球高通膨等的干擾，台股最佳的方式是回檔之際打出第二隻腳，或可能形成三重底。目前反彈強弱勢觀察，最宜要守住0.382的位置14,519點，形成雙底，若是往頭肩底型態發展，回檔壓力將沉。考量美股等國際股市表現不佳，台股本周指數將持續震盪，中小型股表現機會仍大。展望本周的個股表現，依據法人的選股建議條件，挑選今年7月合併營收比去年同期成長、股價在月線之上、投信買超、周量增及上周股價抗跌的個股依序有元晶、光寶科、燿華、台半、和大、眾達-KY、中美晶、元太、振樺電、聚陽、系統電、東陽、茂順、世芯-KY、明安、寶雅、M31等個股。台新投顧副總黃文清認為，投信多方資金偏愛的個股以下半年具有營運題材的如電動車、太陽能、汽車零組件、IP矽智財、內需零售、紡織、網通、電子標籤等個股，部分個股已是投信高持股，其他個股是投信才開始建立持股水位，投資人留意投信的資金變化。世芯-KY、M31為IP矽智材股，其中世芯-KY日前召開法說會，公司釋出的營運展望令法人驚喜，直指車用高效能運算（HPC）、人工智慧（AI）專案加速提升，先進駕駛輔助系統（ADAS）與車用資料中心兩應用領域也陸續進行，世芯-KY的利多帶領其他IP股同步走揚。和大、東陽、茂順等為汽車零組件大廠，美系特斯拉展望樂觀及台系電動車LUXGEN新世代純電休旅車即將上市，將提升台系汽車零組件的營運力道，其中和大第二季獲利創11季來新高，7月合併營收創歷年同期新高紀錄。(新聞來源 : 工商時報一王淑以／台北報導)\",\"image\":\"\\/uploads\\/20220905\\/03beeaa5a79025b433b79e39a04972bf.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662342259),
