(1268,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《台北股市》9月2日股市備忘錄\",\"content\":\"【時報-台北電】9月2日股市備忘錄：＊除權息交易：達新、車王電、訊聯、建大、可成、崧騰、創源、全球傳動、日成-KY、華容、邑錡。＊法說會：大億、基士德-KY、志強-KY、光隆。＊減資後新股掛牌：保銳。＊增資股買賣：立益物流、聯邦銀、康呈、長科*、天宇。＊注意股票：威盛、可成、世芯-KY、祥碩、中天、創惟等。＊處置股票：新世紀。＊恢復原融資比率及融券保證金成數：展宇、六暉-KY、寶一、泰昇-KY、業強、崑鼎。＊降低融資比率1成及提高融券保證金1成：科定、德勝、久威。＊暫停融券賣出（融券最後回補）：綠河-KY、點序、華電網。＊恢復融券賣出：訊聯、崧騰、華容、長科*。(新聞來源 : 工商時報一柯宗沅輯)\",\"image\":\"\\/uploads\\/20220905\\/047d2f3d518e83c942a4cec8a26aed86.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662342380),
(1269,	1,	'admin',	'/houtai.php/ajax/upload',	'',	'{\"category\":\"\"}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662342637),
(1270,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《台北股市》元晶、友達獲投信認養 吸金\",\"content\":\"【時報-台北電】時序接近第三季底，作帳行情在9月底前將逐步放大對股市的影響力，尤其2022年以來投信作為多頭總司令，截至2日止已連續買超台股51個交易日，累計金額高達719.54億元，元晶（6443）、友達（2409）等投信認養股順勢借力。投信9月以來累計買超前兩大為元晶及友達，分別買超1.77萬張與8,430張，且持股比率均低於10％，未來仍有加碼空間。進入下半年傳統旺季，元晶除有政策面支持，包含下半年躉購費率維持與上半年相同，大型案場的加速建置獎勵機制，同時下半年訂單也將以浮動報價反應成本，獲利或將翻倍成長。此外，元晶取得特斯拉旗下太陽能公司SolarCity訂單，配合美國政府通過的「降低通膨法案」，太陽能裝置加速建設，下半年可望放量出貨。另外，具備減資題材的友達，因大陸四川限電令，衝擊中系面板廠，產業庫存有望加速去化，加上市場傳出三星的電視面板將逐步恢復正常拉貨，友達營運有望走出谷底。友達擬現金減資兩成，每股退還2元，減資後股本為769.94億元，9月23日為融券最後回補日，但截至2日止，融券餘額仍有3.46萬張，潛在軋空行情值得期待。(新聞來源 : 工商時報一柯宗沅／台北報導)\",\"image\":\"\\/uploads\\/20220905\\/bcf7a0aecc371d31d4bf65e0377eb1ad.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662342640),
