(1272,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"中秋變盤？三大名師點名題材股：免驚\",\"content\":\"美股回落及外資賣超效應，「中秋變盤」成為市場熱議焦點。三大投資專家認為，在國安基金護盤及季底作帳效應，中秋變盤壓力不大，9月台股可望力守頸線14,500點，有機會彈上月線15,147點到5月低檔15,616點，看好網通、IP、電動車及汽車零組件、蘋果供應鏈等題材類股。統計過去15年中秋前後表現，台股節後上漲機率高於節前，康和證券投資總監廖繼弘指出，美聯準會貨幣政策偏鷹，10年公債殖利率上升至3.2％，美股四大指數拉回跌落季線整理，且美國禁止輝達及超微超級電腦晶片銷陸，影響科技股表現；國安基金低檔護盤支撐信心，台股低檔有撐及融資餘額仍在低檔，蘋果即將發表新機。整體研判9月為14,500點頸線到月線15,147點震盪整理格局。第一金投顧董事長陳奕光認為，美股走弱及外資持續賣超，外資今年來累計賣超逾1.1兆元，但內資投信連續買超、政府基金加碼以及國安基金護盤，近期盤面呈現集中市場弱勢及櫃買市場強勢，中小型股優於權值股也將是9月主旋律。預期9月盤勢將反覆拉回及反彈走勢，指數下檔守14,500點，上檔突破月線有機會上看15,616點。統一投顧董事長黎方國表示，Fed 9月可能再升息3碼，但物價指數見頂將緩步下降，國安基金持續護盤，而中國政府加碼經濟刺激，企業有庫存調整拉貨動能減弱，以及晶圓代工業進入跌價周期等多空因素，影響9月盤勢區間震盪，指數將介於14,600點到15,400點。黎方國看好汽車零組件股、生技股、蘋果新機發表受惠股。廖繼弘認為，現階段逢回選股不選市操作，反彈減碼彈不過季線弱勢股。陳奕光表示，9月選股看好受惠新台幣貶值的鞋類、自行車、高爾夫球桿、汽車零組件，政策加持的綠能、航太、低軌道衛星，以及產業前景佳的電動車及充電樁等。更多工商時報報導訊連人臉辨識 明年貢獻營收惠譽看人民幣 明年貶至6.7元台灣本田首款國產油電車 逆勢降價\",\"image\":\"\\/uploads\\/20220905\\/b50779277bb9986785fde250857ab3bb.jpg\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662342908),
(1273,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"券商晨訊台股投資建議摘要 (1) 2022年9月5日\",\"content\":\"【統一證券】在指數未站上短均線之前，建議保守觀望，嚴控持股水位。操作上建議以綠能\\/儲能、新能源車、汽車零組件及生技等防禦型選股為主。\",\"image\":\"\\/uploads\\/20220904\\/2a786255ed31b6ec522cc91464bbad48.jpg\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662343038),
