(1276,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《晨間解盤》軍演低點迫近 3族群重兵埋伏(國票投顧提供)\",\"content\":\"【時報-台北電】美國公佈8月非農報告，失業率3.7%，略高於預期的3.5%，有望緩解Fed大幅升息的可能性，美股一度上漲，然而盤中時段傳出，北溪一號的維修期限已到，但俄羅斯卻持續關閉管線，消息衝擊市場，美股四大指數由紅翻黑，最終全數收低，幅度介於-1.02%至-1.31%，台積電ADR-0.91%，台指期夜盤-33點(-0.23%)，預期今日台股小幅開低，但先前中國軍演低點14545應有支撐，盤勢有望震盪回升，聚焦高爾夫球、網通、IP矽智財。有鑑於台股KD指標的K值僅剩15，數值進入超賣區，隨時會有跌深反彈的可能性，再者，指數當前點位14673，與先前中國軍演的低點14545相當接近，此為多方重要防線，預期會有強力買盤坐鎮，此處不需急著殺出，若大盤還有開低，反而是趁亂搶進強勢股的好時機。操作方面，聚焦高爾夫球，類股幾乎不受盤勢干擾，出現族群性的行情，且擁疫後復甦題材，短線應有續強契機，另網通、IP矽智財逆勢上漲，亦可留意。由於美元指數直逼110，改寫20年來的新高，加上歐洲央行ECB看法轉鷹，且將於9\\/8(四)舉行利率決議，市場推測，歐元區將跟上美國的腳步，本次很可能升息3碼，須格外留意，不過，考量本週除9\\/7(三)蘋果新品發表會外，也是台股8月營收的密集公佈期，業績成長的個股，有望獲得買盤進駐並率先回穩，可多加關注，此外，9\\/13(二)美國將公佈CPI，短線波動恐持續放大，建議可陸續轉往生技股、反向ETF等避險性質標的，以因應盤勢的快速變化。(國票投顧提供)\",\"image\":\"\\/uploads\\/20220905\\/eee33db5bce3392a633ff1a7ec1e288f.jpg\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662343162),
