(1278,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"【統一證券晨訊】台股預期觀望氣氛濃 宜保守操作\",\"content\":\"日期：2022年 9月 5日※盤勢分析中秋長假將至、市場不確定性高，建議保守操作※昨日盤勢受到前一日美國科技股表現疲弱影響，上周五台股以下跌12點的14790點開出後，台積電、聯發科等大型電子權值股呈現下跌走勢，貨櫃三雄的賣壓也相當大，長榮、陽明、萬海皆重挫逾6%，衝擊台股投資人信心，盤中指數震盪走低跌破14700點，盤面上以生技族群、IP矽智材、伺服器、網通、高爾夫球等中小型族群表現較為強勢，午盤過後賣壓持續湧現，終場指數下跌128點，以14673點作收，成交量能為2343億元。觀察盤面變化，三大類股全數下跌，其中電子、傳產及金融分別下跌0.79%、1.19%及0.53%。在次族群部份，以生技醫療、紡織、營建表現較佳，分別上漲2.22%、0.3%及0.11%。※資金動向三大法人合計賣超173.16億元。其中外資賣超146.32億元，投信買超5.52億元，自營商賣超32.42億元。外資買超前五大為宏達電、統一實、欣興、力積電、景碩；賣超前五大為新光金、華航、開發金、台積電、中信金。投信買超前五大為元晶、友達、華新、永豐金、燿華；賣超前五大為欣興、世紀鋼、南電、台灣大、上緯投控。資券變化方面，融資增1.17億元，融資餘額為1952.41億元，融券增0.16萬張，融券餘額為61.56萬張。外資台指期部位，多單減碼7231口，淨多單部位6059口。借券賣出金額為95.88億元。類股成交比重：電子69.74%、傳產27.31%、金融2.95%。※今日盤勢分析聯準會(Fed)主席鮑威爾在傑克森霍爾年會發表鷹派言論，造成美股全面重挫，目前市場預期九月下旬FOMC會議將升息3碼，通膨、升息影響資本市場的警報並未解除，系統性風險升溫。本周中秋連假將至，台股預期觀望氣氛轉濃。台股後市分析如下：第一、上周五美國8月非農新增就業為31.5萬人，略高於市場預期的30萬人，不過創下2021年4月以來最低增幅，8月失業率為3.7%，高於市場預期，失業率上升可能緩解聯準會9月激進升息的壓力，根據CME Fedwatch，交易員預計聯準會在9月下旬的利率會議上，仍維持升息3碼的機率有60%，略低先前的70%，後續關注8月份CPI數據。第二、財政部週三( 7)將公布8月進出口統計，排除外在因素並以季節性因素推估，預估8月出口值約將落在427億到442億美元區間，出口年增幅約在8%~12%左右，將呈現連續26個月正成長，單月出口仍有望擠進歷年前三大，甚至有望改寫單月新高紀錄。不過，目前全球經濟仍受疫情反覆、通膨升溫與地緣政治緊張等影響，讓產業庫存調整壓力大增，對於後市展望也偏向保守，下半年出口增幅將收斂。第三、上週指數下跌605點，周線連二黑，目前指數跌落所有均線之下，短期均線再次呈現空頭排列，且跌破前低14843，型態上也轉弱，加上外資賣超不斷，指數未重新站上短均線之前，建議保守觀望。第四、美中科技戰影響，台灣矽智材(IP)廠商可望受惠，M31、晶心科、世芯- KY、創意、智原等股價逆勢走揚。生技股在盤勢不穩時成為資金避風港，智擎、合一、台康、永昕、中化生、國光生等短線偏多。※投資策略聯準會官員不斷放鷹，市場預期九月下旬FED將升息三碼，加上美國維持對中關稅，且俄國關閉北溪一號天然氣供應等因素干擾，國際股市表現疲弱。台股指數上週再度跌落所有均線之下，型態轉弱，加上本週中秋連假將至，預期觀望氣氛轉濃，在指數未站上短均線之前，建議保守觀望，嚴控持股水位。操作上建議以綠能\\/儲能、新能源車、汽車零組件及生技等防禦型選股為主。\",\"image\":\"\\/uploads\\/20220905\\/595142e878e8f7458deeb0077ab9bfdc.jpg\"}}',	'165.154.227.81',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662343313),
