(1286,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《晨間解盤》台股弱勢 恐測低點14545點\",\"content\":\"【時報-台北電】上周五大盤持續探低，終場加權股價指數數下跌128.82點，收在14673.04點，成交值為2311.11億元。投顧預估8月4日低點面臨測試。凱基投顧表示，加權股價指數數再創本波拉回新低14673點，短線呈現震盪走低的態勢，並且處於所有均線之下，技術面格局呈現弱勢整理；就格局來看，頸線反壓約15095點沒克服前，盤勢處於劣勢，後續要提防8月4日低點14545點測試的風險。周KD向下交叉，指數後續破底下探，是本波段空頭走勢慣性，本周應特別注意周隨機指標是否向下交叉。當前操作宜謹慎，持股汰弱留強，積極者短多操作應預設損益點，聚焦技術面多方結構未遭破壞，利多題材發酵等近期相對大盤強勢的族群個股。（編輯：沈培華）\",\"image\":\"\\/uploads\\/20220905\\/8f168292008b8d476836d1cdc4d4ce15.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662344967),
