(1338,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《盤前掃瞄-基本面》大立光營收連三月雙升；鴻海8月業績月減5.51％\",\"content\":\"【時報-台北電】基本面：1.前一交易日新台幣以30.710元兌一美元收市，貶值1.22角，成交值為12.28億美元。2.集中市場05日融資減為1939.92億元，融券增為624901張。3.集中市場05日自營商賣超18.40億元，投信買超6.63億元，外資賣超30.48億元。4.大立光重返股王寶座，營收也展現股王的氣勢，8月營收順利繳出連三個月雙成長的成績，也帶動累計營收與去年的差距快速收歛到只剩5.37％的些微差距，蘋果光普照，果然讓大立光放寬心。5.伺服器遠端管理晶片（BMC）廠信驊（5274）8月合併營收4.03億元，累計今年前八月合併營收34.07億元，年成長幅度48.1％。法人指出，信驊下半年營運可望先蹲後跳，全年營收挑戰年增四成以上。6.鴻海5日公布8月營收4,489.06億元，以月減5.51％、年增12.21％，寫下歷年同期新高。另累計前八月營收為3兆8,426.1億元，也超越去年同期、年增9.21％，同步寫下同期新高。7.佳世達（2352）集團8月合併營收出爐，8月合併營收約198.99億元，較去年同期178億元成長12％，續創同期新高。累計今年前8月合併營收1639.6億元，比去年同期的1434億元增加206億元，年成長14.4％。8.IC設計服務廠創意（3443）公告8月合併營收達20.14億元，寫下單月歷史新高。法人表示，創意下半年在委託設計（NRE）及特殊應用晶片（ASIC）等挹注業績帶動下，第三季營運可望挑戰單季新高水準，全年營收將可望年成長4成，並且再創新高。9.不受大環境逆風因素干擾，信邦（3023）營收再創新高，5日公布8月營收27.38億元、月增3.11％、年增23.44％，累計前八月營收達198.58億元、年增17.44％，續創歷年同期新高。10.全球貿易需求減弱，散裝航商慧洋-KY（2637）5日公布8月合併營收20.73億元，月減11.51％、年增21.35％，雖守住20億元關卡寫同期新高，卻連三個月衰退，自結單月稅前盈餘8.04億元，月減19.6％、年增16.78％，每股稅前盈餘1.08元。(新聞來源：工商時報、財經內容中心綜合整理)\",\"image\":\"\\/uploads\\/20220906\\/34c2b3021101c231b39a8dba44be273f.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662426908),
