(1341,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《盤前掃瞄-國內消息》外資前八月淨匯出逾5000億元；新台幣貶破30.7\",\"content\":\"【時報-台北電】國內消息：1.中秋長假效應及聯準會（Fed）主席鮑爾談話前夕，台股多空縮手觀望，單日成交值再度跌破2,000億元，指數維持在平盤附近狹幅震盪。金管會主委黃天牧5日坦言，近期交易量在2,000億元左右，「是需要關注的一個量」，目前正緊盯台股動能、價格及成交量變化，在穩定台股的前提下，會適時推出必要措施。2.美國持續不斷升息，加上地緣政治因素，外資從6月到8月連續三個月淨匯出，據金管會5日公布，8月外資淨匯出54.54億美元，約當新台幣1,655億元，連續三個月合計更已流出130.75億美元（約新台幣3,932億元），無論是6到8月或前八月的外資淨匯出量，都創同期最大淨匯出量，比2008年金融海嘯時更大。3.國際美元指數衝破110，外資熱錢持續賣股落跑，讓新台幣應聲重挫，5日連破30.6元及30.7元二關，終場收在30.71元的近三年新低，單日貶值1.22角，總成交量增至16.84億美元的近半個月最大量。4.中央銀行5日公布8月底外匯存底為5,454.28億美元，月減23.29億美元，央行外匯局局長蔡?民表示，主要是美元強勢，歐元等貨幣對美元重貶，折計成美元後減少。且央行為維持匯市秩序進場拋匯調節（阻貶），也讓外匯存底餘額減少。5.美國升息太鷹、美股四大指數上周跌落季線下、美10年期公債殖利率飆高至3％以上、新台幣重貶、外資今年累計匯出逾5,000億元，多重利空當頭，高成長、高本益比的高價股成重災區，台股剩四千金，沒有900元俱樂部，連500元以上的高價股僅剩16檔，與高峰時幾近腰斬。6.市場傳出台積電將在大阪設立第二座研發基地，不過台積電5日回覆指出，並非增設研發中心，而是日本設計中心（TSMC Japan Design Center，JDC）要在大阪設立新辦公室。7.缺貨多年的辦公市場明年終於可望解渴，統計顯示，台北市中心2023年將有七大指標辦公大樓陸續完工落成，總計面積將有7.4萬坪，可望是16年以來最大量。其中「富邦A25」、「皇翔台汽北站」，分別可望挑戰東、西區區域租金新高。8.商業發展研究院5日公布商業服務業景氣預測及分析，顯示下半年來雖因疫情緩和，「報復性消費」助力，但輸入型通膨下，國民實質購買力仍難提高，所幸先前「預期上漲心理」持續上揚的房價已見平息，實質不動產及住宅服務業GDP雖仍微幅成長，但景氣循環趨勢持續走緩，有助通膨預期降溫。9.市調9月上旬面板報價出爐，面板價格跌幅持續收斂，65吋以下的電視面板單月跌幅收斂到5美元以下，驅動IC等零件價格鬆動，面板廠也推出43吋成本優化版本刺激需求，推動43吋面板報價跌破50美元，來到歷史低點。整體來看，第三季電視面板價格平均跌幅約10％～15％，第四季價格跌幅有機會縮減到個位數。10.瑞信論壇與蘋果秋季發表會聯袂送暖台股之際，多空爭論卻一波未平、一波又起，匯豐證券在全球市場範圍中降評台股至「減碼」，所持三大理由除擔憂全球經濟、兩岸關係外，還包含因指數中所含成分市場不同因而「代替南韓遭殃」的非戰之罪，市場看法兩極。(新聞來源：工商時報、財經內容中心綜合整理)\",\"image\":\"\\/uploads\\/20220906\\/bdd46deacb60509c1e4100b22f4bb5a5.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662426985),
