(1344,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《盤前掃瞄-國外消息》美元指數升破110；鮑爾9\\/8演說\",\"content\":\"【時報-盤前掃瞄】國外消息：1.美元指數升破110 刷新20年最高。俄羅斯國營能源巨擘Gazprom宣布無限期停止北溪一號對歐洲的天然氣供應，歐洲能源危機急遽升高，周一摜壓歐元貶破0.99美元支撐，創20年新低；美元對英鎊與日圓等主要貨幣也均走堅，美元指數一舉升破110大關。2.人行阻貶 降外匯存準率8碼。人民幣兌美元匯價近月來跌跌不休，朝7元整數關卡進逼。中國人民銀行5日終於出手阻貶，宣布自9月15日起大舉調降金融機構外匯存款準備金率2個百分點（8碼），這是人行年內第二度下調外匯存準率，約向市場釋出190億美元（約5,833億台幣）的流動性。人行宣布後，離岸價一度跳升200個基點至6.93元附近。3.又見鷹蹤？鮑爾9\\/8演說掀牌。美國聯準會（Fed）主席鮑爾（Jerome Powell）8日將發表演說，由於這是他自8月26日全球央行年會後的首度公開談話，在美國就業市場已現趨緩跡象，市場欲從鮑爾本周演說內容，尋找Fed是否在本月例會仍將堅持升息3碼訊息。4.英新首相特拉斯 拚突圍經濟風暴。英國外相特拉斯（Liz Truss）在保守黨黨魁大選中擊敗蘇納克，確定將取代強生，成為英國新首相，將帶領英國克服通膨破表的經濟風暴。5.救經濟 廣東頒布穩工業7條。大陸仍未走出4～5月疫情後的經濟陰霾，近期多地繼續大力度推出新的穩經濟、促消費措施。如廣東近日頒布「穩工業7條」措施加大基建與復產力度，發改委也喊話要求各地方加速在第三季推出重要政策，預期9月各省市還將陸續推出新措施。\",\"image\":\"\\/uploads\\/20220906\\/68ca37b434dc8a67e3a89fff28f8727c.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662427061),
