(1346,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《晨間解盤》觀望氛圍 狹幅震盪(國票投顧提供)\",\"content\":\"【時報-台北電】美股週一因勞動節休市，不過美期照常交易，三大期指均以小漲作收，今天早盤仍延續漲勢持續開高，目前漲幅都在0.4%上下，至於台指期夜盤同樣表現不大，終場小漲27點(+0.18%)作收，預期台股將以平高盤開出，盤中維持狹幅震盪，走勢仍偏觀望。台股週一開低後震盪走低，儘管台積電、中鋼、台塑集團及部份金控股早盤稍有表現，一度試圖拉抬指數向上，惟中小型股賣壓沉重，開盤不久隨即走弱，加上新台幣盤中重貶刷新3年新低，熱錢持續撤出疑慮升高，導致台股欲振乏力，終場小跌11點(-0.08%)，以14661點再度創下波段新低。觀察週一櫃買指數開盤後隨即拉回，且在尾盤跌勢加重，以致終場收跌1.5%，似乎中小型股歷經之前的漲勢後，已出現較大的調節壓力，連帶波及集中市場，短線上應稍加留意此情況是否有擴大跡象。操作方面，可聚焦面板、太陽能族群，前者具現金減資及面板報價可望觸底題材，後者具市場熱度及技術面、籌碼面優勢，股價續有表現空間，可持續留意。美元週一一度觸及110大關，再創20年來的新高，加上歐洲央行ECB看法轉鷹，即將於9\\/8(四)舉行利率決議，推估歐元區將跟上美國的腳步，本次很可能升息3碼，須格外留意，另考量本週除9\\/7(三)蘋果新品發表會外，也是台股8月營收的密集公佈期，業績成長的個股，有望獲得買盤進駐並率先回穩，可多加關注。此外，9\\/13(二)美國將公佈CPI，短線波動恐持續放大，建議可陸續轉往生技股、反向ETF等避險性質標的，以因應盤勢的快速變化。(國票投顧提供)\",\"image\":\"\\/uploads\\/20220906\\/bbb721c6b23562d5fccb9c6e468589c7.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662427172),
