(1348,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"【統一證券晨訊】均線空頭排列 整理期恐拉長\",\"content\":\"日期：2022年 9月 6日※盤勢分析均線空頭排列、整理期拉長，謹慎操作※昨日盤勢受到美股上周五美股持續重挫影響，昨日台股以小跌2點14670點開出後，雖然一度拉升至上漲80點，至14753點；但很快賣壓湧入，指數持續拉回至跌破平盤，但維持在平盤附近震盪，跌勢並無進一步擴大。權值股中以台積電、聯發科、台達電、廣達、華碩、和碩及南電等小有表現；強勢股仍以不佔權值的生技股醣聯、北極星、景岳、懷特、中裕等，領漲表現。終場指數小跌11點，以14661點作收，成交量能為1881億元。觀察盤面變化，三大類股漲跌互見，其中電子、傳產分別下跌0.21%、0.1%，金融上漲0.57%。在次族群部份，以電器、資訊服務、觀光等走勢最弱，分別下跌2.04%、1.39%及1.11%。※資金動向三大法人合計賣超45.1億元。其中外資賣超30.6億元，投信買超3.9億元，自營商賣超18.4億元。外資買超前五大為陽明、友達、永豐金、群創、長榮；賣超前五大為宏達電、華航、力積電、玉山金、華晶科。投信買超前五大為元晶、友達、永豐金、眾達、仁寶；賣超前五大華通、上緯、鴻海、智易、南電。資券變化方面，融資減12.5億元，融資餘額為1939億元，融券增0.93萬張，融券餘額為62.4萬張。外資台指期部位，多單加碼3716口，淨多單部位7388口。借券賣出金額為66億元。類股成交比重：電子70.5%、傳產25.5%、金融3.8%。※今日盤勢分析聯準會(Fed)主席鮑威爾在傑克森霍爾年會發表鷹派言論，造成美股全面重挫，目前市場預期九月下旬FOMC會議將升息3碼，通膨、升息影響資本市場的警報並未解除，系統性風險升溫。本周中秋連假將至，台股預期觀望氣氛轉濃。台股後市分析如下：第一、預期聯準官員談話維持鷹派論調，繼續打壓市場風險偏好。本周相當多FED官員談話，包括周三(7)克里夫蘭銀行總裁梅斯特(偏鷹派)；周四(8)鮑威爾(鷹派)、副主席布雷?德(可能鴿轉鷹)；周五(9)芝加哥銀行總裁艾文斯(可能鴿轉鷹)，在鮑威爾定調下，預期將有偏鷹派的發言。而CPI單月數據下滑，不足以影響聯準會的貨幣決策，9月升息3碼的機率仍高，升息循環的終點目前亦維持在3.75%-4%。這個終點在9\\/22的FOMC會議前，可能隨時會再上調。第二、台灣八月出口值，有機會挑戰單月新高。財政部將在周三(7)，公布8月進出口統計，在iPhone 14新機上市的拉貨期，與全球車用晶片需求旺盛，預估今年8月出口值上看427億～442億美元，有機會改寫歷年單月出口規模新高，與最強8月紀錄，年增率約8％～12％。以出口正成長紀錄觀察，8月份出口估維持正成長，這將創下連26紅紀錄。第三、均線空頭排列、整理期拉長。台股持續盤跌，未有重量權值股拉盤。目前台股各均線呈現空頭排列，上檔明顯壓力在季線14987點位置，在季線持續向下牽引下，原本已經轉上的月線，也受其影響轉而向下。在台幣超級弱勢下，外資持續賣超，盤勢不容樂觀。第四、題材股匯集人氣，生技股成最佳避風港。在利多訊息簇擁下，生技股在北極星的領軍持續創高下，三顧、明達醫、醣聯、熱映、濟生、晉弘、邦特、景岳、太景及益得等走強明顯。其他如其陽、矽瑪、映興、瑞智等也表現強勢。※投資策略聯準會官員不斷放鷹，市場預期九月下旬FED將升息三碼，加上美國維持對中關稅，且俄國關閉北溪一號天然氣供應等因素干擾，國際股市表現疲弱。台股指數跌落所有均線之下，型態轉弱，上檔壓力重。加上本週中秋連假將至，預期觀望氣氛轉濃，在指數未站上短均線之前，建議保守觀望，嚴控持股水位。操作上建議以綠能\\/儲能、新能源車、汽車零組件及生技等防禦型選股為主。\",\"image\":\"\\/uploads\\/20220906\\/e4fabd61f2ece01a4aff0400f8c36e3b.png\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662427532),
