(1350,	1,	'admin',	'/houtai.php/news/add?dialog=1',	'财经新闻 / 添加',	'{\"dialog\":\"1\",\"row\":{\"title\":\"《晨間解盤》下探風險未除\",\"content\":\"【時報-台北電】周一台股再探新低14632點。終場加權股價指數數小跌11.94點，收在14661.1點，成交值萎縮至1881.72億元。店頭市場賣壓出籠，跌幅1.5%高於大盤。凱基投顧表示，周一多方力圖振作，雖然盤中一度反彈約80點，但最後無功而返，並且再創本波拉回新低14632點。上市電子周一持續走低，創下675.58點新低，並且又領先大盤跌破八月初低點(8\\/2 677.88點)。短線大盤技術面、指標面及籌碼面持續偏空，類股漲跌架構也朝向負面發展，顯示大盤下探風險未除，後勢仍有低點。操作建議保持謹慎，先以控管風險為主，持股汰弱留強，暫待止跌回穩訊號浮現。（編輯：沈培華）\",\"image\":\"\\/uploads\\/20220906\\/7da805714103cf17010cdfc8c0149bbe.jpg\"}}',	'165.154.226.244',	'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36',	1662427642),
