INSERT INTO `fa_news` (`id`, `title`, `content`, `image`, `createtime`, `updatetime`) VALUES
(4,	'高端疫苗次世代新冠疫苗一期結果出爐 追加劑可對抗BA.4、BA.5',	'<p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">高端疫苗 (6547-TW) 今 (1) 日宣布，國際生醫資料庫 MedRxiv 發布次世代新冠疫苗 (MVC-COV1901-Beta) 一期臨床試驗數據，證實高端的原型株、次世代疫苗作為追加劑，都可對 Beta 株、Omicron 變異株 BA.4、BA.5 產生免疫反應。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">為評估次世代疫苗和原型株作為追加劑的安全性、耐受性和免疫生成性，高端在北醫附醫及三軍總醫院共計收納 107 名 18~55 歲受試者，以中和抗體試驗、記憶 B 細胞試驗分析對變異株的免疫效果。</span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">高端說明，此次實驗分別使用原型株疫苗、15 mcg Beta 株疫苗及 25 mcg Beta 株疫苗施打追加劑。受試者分為 A 組 (2+1 針，間隔 8 個月施打追加劑) 或 B 組 (3+1 針，4 個月後施打追加劑)，安全性部分，無與疫苗相關的嚴重不良事件，耐受性也良好。</span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">高端指出，一期臨床數據證實，若以原型株作為追加劑，對於變異株 Beta、Omicron BA.4/BA.5 仍有疫苗免疫效果，但變異株會降低疫苗效力；而以 Beta 株疫苗作為追加劑，效果比原型株更好，可顯著提升對武漢株、變異株 Beta、Omicron BA.4/BA.5 的中和抗體效價。</span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">高端表示，無論使用何種組合的追加劑，施打後都顯示追加劑可誘導免疫記憶反應，並對變異株產生更全面交叉免疫反應，結果與 mRNA 疫苗加強劑的表現一致。</span></span></span></span></span></p>',	'/uploads/20220902/8fef3b7f0336357273abac0eee6b2185.jpg',	1662058107,	1662058144),
(5,	'期交所訂「3+E」發展重點 客製化契約交易平台明年底前上線',	'<p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">期交所去 (2021) 年繳出亮眼成績單，總交易量達 3.9 億口，成長達 14.9%。為促進市場穩健成長，期交所董事長吳自心今 (1) 日宣布，擬定「3+E」發展重點：建置客製化契約交易平台、擴大店頭集中結算規模、推出期貨風控防衛機制 2.0、促進期貨業永續 (ESG) 發展。其中客製化契約交易平台預計明年底建置完成，期盼帶領期貨市場邁向新未來。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">首先，建置客製化契約交易平台部分，期交所總經理周建隆表示，為擴大市場參與，規劃建置客製化契約交易平台，預計明年底建置完成，屆時可提供交易人隨選服務，交易所需的契約規格，可彈性選擇契約到期月份、履約價格、到期結算方式等，提供多元交易服務。初步規劃客製化契約標的以股價指數、股票等股權類商品為主，未來將持續研議擴大適用商品範疇。</span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">第二是擴大店頭衍生性商品結算規模，提升國際能見度。周建隆表示，今年 7 月 25 日正式開辦店頭衍生性商品集中結算業務，推出結算會員自營交易自願性新臺幣利率交換契約 (IRS) 集中結算，目前有 11 家結算會員，結算部位餘額達新臺幣 176 億元。</span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">周建隆進一步指出，明年 6 月規劃推出客戶端及新臺幣無本金交割遠期外匯 (NDF) 集中結算，屆時無論是 IRS 或 NDF 的自營或客戶交易皆可集中結算，結算會員預計增加至 23 家。後續研議推出新臺幣無本金交割利率交換契約等，並持續積極爭取國外合格集中結算機構 (QCCP) 資格認可，吸引外資參與集中結算市場。</span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">第三個發展重點是推出期貨風控防衛機制 2.0，周建隆表示，為強化期貨市場風險控管機制，期交所、期貨商、交易人三方攜手合作，升級市場防衛機制，以增強市場穩健。期交所將所有商品納入動態價格穩定措施、買賣申報整批撤銷機制推廣至經紀商、推出斷線後刪單等；期貨商端強化夜盤風控機制，如日盤收盤後壓力測試、交易人帳戶風險提醒注意等功能。</span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">而在 ESG 發展方面，周建隆表示，期交所將建置期貨市場 ESG 資訊平台，建構期貨市場永續金融生態，協助期貨商導入永續治理架構，鼓勵期貨業者推動 ESG；建置期貨市場 ESG 資訊平台，可以提供交易人一站式查詢便利服務，強化資訊揭露，進一步推廣 ESG 交易概念，深化期貨市場永續發展。</span></span></span></span></span></span></p>',	'/uploads/20220902/74c156c5ecc6cf862cedc8af6b3205c9.jpg',	1662058273,	1662058273),
(6,	'〈大同高層異動〉副董王金來真除兼任總座 打造企業控股大艦隊',	'<p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">大同 (2371-TW) 今 (1) 日宣布，副董事長王金來正式真除兼任大同新總經理，展望未來，他說，大同擁有跨產業事業優勢，將強化集團在電力、新能源、資通訊及消費產業與子公司協同，發揮綜效，進一步打造大同大艦隊。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">王金來在報告前以「個人榮耀、全力以赴」八個字開場，未來集團持續以創能、儲能、節能等三能作為發展的大方向不變，公司事業部中高階專業經理人流動性不大，且擁有穩定的向心力、生產力，擔任總經理後，將發揮溝通整合的長才，成為事業發展、經營的後盾。</span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">王金來進一步指出，大同已連五季獲利，未來將鞏固優化核心實力，現有九大事業部也將會整合優化成事業群，同時集團已是產業控股，子公司業務規模在大同財報占約 50%，未來除本業外，也將加強集團控股效益。</span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">當中包含規劃及評估華映除列、精英併表、大同智能擴展等，在創新策略下，大同將以成為國家及企業的數位與能源轉型推手作為集團目標。</span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">值得注意的是，王金來也身兼精英副董事長暨總經理，針對精英併入合併報表時程，雖然未給出明確時間，但強調大同仍會持續加碼持股，並適時請會計師評估是否具營運實質控制權，目前大同持股精英約 32%，8 月時董事會也通過擬在一年內以 10 億元額度內持續增持精英持股。</span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">王金來希望，母子公司營收獲利比維持 50:50，同步成長、價值轉型，進而讓大同成為穩定成長獲利的產業控股公司，確保全體股東與員工的最大利益。</span></span></span></span></span></span></p>',	'/uploads/20220902/4a7c9ce3ef739330224b9afafe769390.jpg',	1662058993,	1662059018),
(7,	'〈碩天法說〉東南亞產能提升減輕銷美關稅壓力 菲律賓廠續擴產',	'<p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">不斷電系統 (UPS) 廠碩天 (3617-TW) 表示，隨著東南亞產能提升，美中貿易戰關稅對成本的壓力逐漸減輕，營運將走出逆風、獲利可望回升，也將持續擴充菲律賓廠產能。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">碩天表示，公司北美銷售比重高，加上品牌與代工性質不同，需自行吸收關稅、航運等費用成本，難以轉嫁。其中，2018-2022 年光關稅就占公司成本達 8%，導致營運也大幅受影響。</span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">不過，隨著碩天菲律賓廠產能爬升，加上部分外包給越南代工廠出貨，目前公司銷北美產品有 6 成由東南亞出貨，若以整體產能來看，東南亞比重已達 5 成。</span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">碩天表示，雖然菲律賓廠多了原料運輸成本，但當地人力與規模效益仍具成本競爭力，因此會持續擴充當地產能。</span></span></span></span></p>',	'/uploads/20220902/bbb721c6b23562d5fccb9c6e468589c7.jpg',	1662059236,	1662059236),
(8,	'低軌衛星國家隊成形   昇達科 建漢大成長時代來臨',	'<p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">台股周四 (9/1) 收 14,801 點，下跌 293 點，成交量 2,305 億。因美限制 AI 晶片銷往中國，CPU 業者恐受波及，後續的半導體供應鏈將遇逆風，估矽智財、 ABF 載板、 網通交換器、 封測等可能受衝擊，以台積電 (2330-TW) 為首的相關個股受打壓，短線先停看聽，例如: ABF 載板三雄: 欣興 (3037-TW)、 景碩(3189-TW)、 南電(8046-TW) 今股價全躺平，轉為弱勢，這些類股處於風暴中心，未轉強之前，不輕易摸底方可持盈保泰!</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">萬寶投顧陳子榕表示，不受美中貿易升級版的衝擊，主要有二大族群:</span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">一. 元宇宙族群: 威盛集團為首，威盛 (2388-TW) 昨日漲停創高，今日稍作拉回休息，後市仍看好: 王雪紅董座力排眾議為聯想電腦獨董，搶進中國元宇宙市場: 位速 (3508-TW) 、建達(6118-TW)、 驊訊(6237-TW) 成長空間大。光學族群也受惠蘋果於 2023 年推出 ARVR 頭盔式裝置，今日整齊劃一上攻，揚明光 (3504-TW)&amp;amp;nbsp; 先進光(3362-TW) 收漲停創新高；這一波元宇宙相關個股，拉回承接沿路操作可說是順風順水，有低檔布局者，漲幅至今超過五成!</span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">二. 低軌道衛星族群: 目前位階仍低，剛剛發酵而已，建議放長線釣大魚</span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">全球的低軌衛星商機到底有多旺? 根據 Grand View Research 調查顯示，2023 年全球衛星產值達 3,083 億美元，且 2029 年低軌衛星發射國家佔比「美國」就高達 88%。目前全球四大低軌衛星營運商美國佔了兩家，分別是 Starlink 和 Amazon 底下的 Project Kuiper。數據顯示，明年全球將有 1328 顆低軌衛星會開始商轉，之後每年布建的商轉數量呈現大幅度增加，相關個股剛剛萌芽!</span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">萬寶投顧陳子榕強調，根據經濟部工業局指出，台廠可切入的商機有先進的通訊射頻與相列陣列天線技術、晶片設計高頻材料、基頻調變、追星控制等系統整合。台灣在資通訊產業具有優勢，衛星終端設備與元件供應，我國已有近 40 家業者切入 SaceX、Oneweb 等多家國際衛星大廠與地面元件供應鏈，預期將吸引更多業者投入。</span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">在目前的國際氣氛之下，美國通過晶片法案和烏俄戰爭星鏈一戰成名，相信未來在全球低軌衛星的供應鏈中，台廠將可站得一席之地。相關低軌衛星股，仍在初級萌芽階段，昇達科 (3491-TW)、台揚(2314-TW)、建漢(3062-TW)、華通(2313-TW) 、燿華(2367-TW) 等仍值得留意。</span></span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">指數再大幅拉回打第二隻腳，只要不破 14,545 點，就形成雙底。大盤利空測試，不破前低之下，仍選擇好股拉回來承接: 陳子榕更細心挑選值得投資人注意的三檔股票：</span></span></span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">建漢 (3062-TW)，建漢 7 月營收 6.06 億元，月減 2.7%、年增 134.6%，前 7 月營收 25.61 億元，年增 13.2%，受惠缺料供應緩解，以及越南廠產能利用率提升，帶動 6、7 月出貨成長。下半年表現可望優於上半年，目標獲利逐步改善，建漢將持續優化營運，逐步擴大營收與事業版圖。</span></span></span></span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">合晶 (6182-TW)，近期半導體供應鏈進入庫存調整階段，但矽晶圓市況仍熱絡，合晶 8 吋產能維持滿載，且由於車用產品比重達四成以上，受到消費性電子市場需求轉差的影響有限，在 8 吋產能滿載且價格可望持續調漲，加上 6 吋價格仍在高檔，第 3 季營收可望持續走揚，下半年營運展望審慎樂觀。</span></span></span></span></span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\"><img src=\"https://cimg.cnyes.cool/prod/news/4944525/l/a1cd586031cd51c25ef69e8240b8976a.jpg\"/></span></span></span></span></span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">耀登 (3138-TW)，射頻暨測試廠耀登科技旗下耀睿科技，聯合中華電信合作建置的全台唯一 O-RAN 測試設備實驗室，拿到了現今最活躍的 5G 開放網路國際聯盟（O-RAN Alliance）認可的全球第一家第三方公正實驗室，堪稱台灣之光; 下半年的表現可望超越上半年。</span></span></span></span></span></span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\"><img src=\"https://cimg.cnyes.cool/prod/news/4944525/l/9f98628e2e9aab1eafc498f71b92cf07.jpg\"/></span></span></span></span></span></span></span></spa