(9,	'保瑞完成併購安成藥業 晉升國內產能最大藥業集團',	'<p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">保瑞 (6472-TW) 今 (1) 日宣布，正式併購安成國際藥業，晉升為國內產能最大的藥業集團，保瑞董事長盛保熙表示，未來安成將聚焦於研發與國際授權銷售，藉由安成藥品研發優勢及製造技術，整合保瑞旗下 CDMO 一條龍服務，可望大幅帶動保瑞營運、獲利上攻。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">保瑞表示，併購安成後，將擁有更完整的產品開發與製程研發技術，並新增眼藥水劑型佈局更完整的劑型生產線，成為更具競爭優勢的國際 CDMO，安成則可利用保瑞量產能力，擴大安成旗下美國學名藥出貨，降低成本並擴大市占率。</span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">另外，在藥品經銷與授權部分，保瑞指出，安成將與跟保瑞聯邦進行階段性整合，建立全球化銷售團隊。</span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:32px\">法人指出，安成加入保瑞後，除了既有產品外，未來也將開發新品項，持續挹注營收，保瑞在 CDMO 量能整合與藥品經銷授權雙引擎帶動下，可望持續交出亮眼成績。</span></span></span></span></p>',	'/uploads/20220902/87f5c4eacab3f9ed653480e25685a3c3.jpg',	1662059872,	1662059872),
(11,	'外資大舉提款台積電及金融股 逆勢加碼面板雙虎',	'<p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:18px\">台股今 (1) 日在電子權值股壓盤走弱下，終場大跌 293 點，收在 14801 點，不僅跌破萬五，也再度失守所有均線，三大法人合計賣超 475.4 億元，其中，外資狂砍 332.47 億元，狙擊台積電、金融族群，但大舉搶進面板雙虎，反觀內資則持續力挺台股，投信連 50 買再刷紀錄。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:18px\">三大法人動向，外資今日大賣台股 332.47 億元，寫下 6 月 14 日以來、近 59 個交易日賣超金額最大量，投信則連 50 買，續買超 6.05 億元，自營商則與外資同站在賣方，今日賣超 148.97 億元，合計三大法人賣超 475.4 億元。</span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:18px\">期貨操作方面，外資今日大舉減碼 7231 口多單，多單未平倉口數降至 6059 口，投信則加碼 617 口空單，空單未平倉口數達 8442 口，自營商則由空翻多，加碼&amp;nbsp; 3315 口多單，多單未平倉口數達 427 口。</span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:18px\">外資大砍台股 332 億元，鎖定電子權值、金融股調節，前十大賣超均破萬張，光金融股就占 4 檔，其中，新光金、中信金各有 34117、24864 張，分居一、二名，台積電也遭砍 18602 張，提款金額逾 91 億元，其他還包含國泰永續高股息、玉山金、鴻海、台新金、國泰智能電動車、力積電、欣興等。</span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:18px\">買超方面，外資回頭買超面板雙虎友達、群創，今日買超 15285 張、7242 張，躍居前二位，長榮航、元晶也各有 6858 張、6251 張，其他則依序為燿華、中天、統一實、高力、智擎、神隆等。</span></span></span></span></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;\"><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; white-space: pre-wrap;font-size:18px\">投信操作上，今加碼元晶 7714 張最多，友達也有 5130 張居次，其他還包含華航、仁寶、英業達等，至於賣超方面，則大砍 ABF 三雄，欣興 4708 張居冠，景碩、南電也各有 2845 張、1143 張，華通也有千張以上。</span></span></span></span></span></span></p>',	'/uploads/20220902/a860979ef4d279639c61a77305e589fe.jpg',	1662061023,	1662062373),
(14,	'《台北股市》外資單周賣超台股逾800億 選前借「鷹」洗盤？',	'<p>【時報記者任珮云台北報導】聯準會鷹派發言，加上熱錢持續撤出，讓台股本週週線連二黑，全週下跌605.4點，週線跌幅-3.96%，外資連續第5週站在賣方，本週賣超金額再擴大至880.11億元，改寫6月20日當週以來最大單週賣超金額，也使得今年來外資累計提款金額再推高至1.13兆元。\r\n\r\nPGIM保德信科技島基金經理人孫傳恕指出，近期台股走勢再度轉弱，主要是受到聯準會強硬的升息態度影響，股市評價面下滑，加上外資賣超台股金額持續擴大，熱錢持續撤出，多頭信心受到壓抑，使得台股再度落於各天期均線之下。另外，隨著中秋節將至，根據歷年統計，中秋節前台股賣壓較為沉重，待中秋過後指數較能漸入佳境，且蘋果發表會即將於下週登場，有望替蘋概股題材加溫。\r\n\r\n安聯投信台股團隊表示，目前台股本益比下修至10.5倍左右、近十年低點，殖利率則來到十年高點；若就從價值面來看，台股資金去化效益逐步浮現，台股下檔風險也開始收斂。\r\n\r\n日盛精選五虎基金投資團隊指出，台股經過第三季落底後，研判美國CPI見高，台股有機會結束中期回檔格局，預期企業營運及獲利持續成長，帶動台股反彈。選股上更要選擇獲利成長的公司，靜待庫存去化及淡季過去。建議投資人可趁勢採定時定額或分批方式布局台股基金，迎接台股築底反彈行情。\r\n\r\n安聯投信台股團隊表示，由於升息效應、高通膨、以及扮隨氣候變遷等帶來的高電費開銷等，勢必將排擠消費，因此接下來可先關注iPhone銷售狀況，再來判斷終端消費市場氛圍。\r\n\r\n孫傳恕表示，隨著台灣與美國的選情加溫，在政策與籌碼做多之下，有利於選舉行情發酵，加上根據歷年美國期中選舉的股市表現，在該年10、11月美股上漲走勢居多，對於提振台股整體投資情緒有加分作用。</p>',	'/uploads/20220903/e4992de7715b98ec58b179bbbf25df31.jpg',	1662208308,	1662208328),
(15,	'台積電創一個半月新低 台股失守14700點',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">台股在台積電、聯發科及航運股震盪走低下，終場下跌128.82點，跌幅0.87%，收在14673.04點，成交值新台幣2311.11億元。加權股價指數數失守14700點整數關卡，周線連二黑。</p><div class=\"caas-figure-with-pb\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; max-height: 533px;\"><div style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"><div class=\"caas-img-container caas-img-loader\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px 0px 963.15px; list-style: none; border: 0px;\"><img class=\"caas-img caas-lazy has-preview\" alt=\"台股失守14700點整數關卡，周線連二黑。（檔案照）\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none;\"/></div></div></div><p><br/></p>',	'/uploads/20220903/800a80fd32af6086d637e09b431a5a45.webp',	1662208800,	1662208877),
(13,	'《各報要聞》失守100美元 鐵礦砂跌至九個月新低',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】大陸疫情復燃，深圳和成都相繼淪陷又封城，市場隱憂燈號亮起，導致國際鐵礦砂原料價格重挫，跌破每噸100美元整數關卡，創逾九個月來新低，恐衝擊第四季鋼市傳統旺季。中鋼董事長翁朝棟出面信心喊話，強調這是短暫波動現象，不必驚慌。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">翁朝棟指出，大陸將於10月16日召開20大會議，將適時公布未來五年經濟計畫，預期將會釋放許多大利多的消息來挽救經濟，屆時市場需求動能就會跟著起來，值得市場觀察。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">對於澳洲鐵礦砂行情再度走跌，翁朝棟認為，深圳、成都因疫情嚴峻相繼封城，多少影響市場需求，尤其對電子業的供應鏈影響較大，但對鋼鐵業的影響有限。澳洲鐵礦砂每噸跌破100美元，屬於短暫波動現象，因鐵礦最近的波動區間都在90至100美元，甚至120美元間游動，所以這次再度回檔到95美元，相當正常，不必驚慌，也不致衝擊到第四季鋼市傳統旺季。長期而言，仍持續看好鋼市前景。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">國際鐵礦1日再度反轉重挫，每噸跌破100美元價位。據了解，主要因成都實施封控，市場擔憂大陸經濟再遭衝擊，致使鋼價走弱，拖累鐵礦砂價格重挫。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">根據外電報導，鋼市進入「金九」旺季第一天，澳洲62％品位粉礦運往大陸的價格，單日大跌4.7美元，每噸滑落到95.45美元，單是本周四個交易日就大跌9.75美元，跌幅9.3％。鐵礦已來到去年11月22日95.25美元以來的新低。鐵礦8月共大跌14.35美元，跌幅12.5％。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">鋼鐵專家指出，鐵礦價反轉重挫，主因大陸疫情再起，大陸黑色商品同跌，現貨鋼價也欲漲乏力，呈現小幅漲跌態勢。此外，近日來國際鎳價也重挫，1日期貨價盤中最高價為每噸21,115美元，最低20,275美元，上下震盪840美元，終場收20,311美元。(新聞來源 : 工商時報一林憲祥／高雄報導)</p><p><span style=\"font-size: 14px;\"></span><br/></p>',	'/uploads/20220903/b75593a743ae00925bc33035f9e96973.jpg',	1662180617,	1662208382),
(16,	'《各報要聞》SCFI跌破3,000點 美西線最慘',	'<p>【時報-台北電】貨櫃海運運價暴跌震撼市場，9月首周寫下疫情來最大跌幅，2日上海出口貨櫃運價指數SCFI一舉跌破3,000點，跌幅最重逾22％的美西線，40呎櫃運價驚見3字頭，短短一周接連失守5,000、4,000美元等二大關卡，地中海線20呎櫃運價也失守5,000美元關卡，美東線剉咧等，下周40呎櫃面臨8,000美元保衛戰。\r\n\r\n法人示警，美西線跌跌不休，中小型航商或是高價租船恐將面臨損益邊緣，大陸清零停產重啟，加上歐美庫存偏高需要時間消化，預估貨量仍將持續下探。\r\n\r\nSCFI最新報價下跌9.72％至2,847.62點，已連續12周下跌，回測2021年4月中低點。據統計，SCFI指數從歷史高點下跌至今逾44％，其中美西線40呎櫃運價腰斬、跌幅逾51％最多，其次歐洲線20呎櫃運價下跌逾45％，美東線每40呎櫃下跌逾30％。\r\n\r\n海運三大聯盟持續調控艙位，減班護「價」，貨代業者透露，9月2M聯盟歐洲線減班10％、THE聯盟減班18％。航商在第四季淡季會有減班措施，今年提早一個月，除了例行性安排船舶檢修，當然有支撐運價的考量。\r\n\r\n貨代業者直指，運價積弱不振，就是「貨太少、船太多」，貨量急縮，新船卻持續下水。對運輸業來說，重要指標是數量，通膨讓消費者購買力減弱，再者，人們在非貨櫃運輸的食品、燃料花費增加，而服裝家具、電子產品等傳統貨櫃運商品卻減少。\r\n\r\n海運現貨價跌跌不休，貨櫃三雄2日股價跌勢沈重，長榮失守80元關卡，下跌7.54％、收79.7元；陽明跌7.42％、收71.1元，面臨70元保衛戰；萬海也失守80元，下跌6.81％、收78元。長榮、陽明成交量分別近12萬張、逾10萬張，居上市公司前五名。\r\n\r\n航商、貨代業者表示，歐美市場通膨罩頂，需求不振、庫存積壓，隨貨源減少，船公司填艙壓力引發殺價搶貨現象，歐美主要港口罷工、壅堵程度，將決定運價跌勢速度。接下來就看庫存消化、通膨緩解，是否有季節性需求、一般性商品補貨，支撐運價。(新聞來源 : 工商時報一邱莉玲／台北報導)</p>',	'/uploads/20220903/6d3fe9670cae049c55c9d2dcadb21734.jpg',	1662209052,	1662209052),
(17,	'《各報要聞》16檔DNA股 搶賺機會財',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】美國聯準會（Fed）主席鮑爾鷹式升息，強力對抗通膨，台股遭受池魚之殃，外資今年賣超逾兆元，每日成交量縮至約2,000億元。市場法人表示，資金動能不足大型股難有表現，此時價差交易當道，配合貶值受惠、政策支持，與產業前景最看好的車用電子三題材，篩選包括中興電等16檔DNA概念股，有望提升獲利的機會。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">專家進一步說明，所謂的DNA概念選股法，D指的是Depreciation，即新台幣貶值受惠股，如紡織成衣、製鞋、自行車等，因新台幣貶值兌美元匯率跌破30.5元關卡，外銷產業受惠匯兌收益的挹注。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">N是National Policy，即政策支持的公共建設、國防工業、低軌衛星等產業。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">至於A，則是指Automotive，意指汽車及其零組件的企業，尤其國產電動車才剛開賣就封盤，潛在的龐大需求相當可觀。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第一金投顧董事長陳奕光指出，美國加速升息環境下，美元走強，新台幣走弱，台股指數上攻動能有限，基本面又存在調庫存壓力，個股操作宜採價差操作，而中小型題材股較有機會財可期。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">他指出，綠能、風電等替代能源，在政策加持下，未來供電比重持續增加，較不受景氣波動影響。台電1,500億元的供電穩定及汰舊換新措施，將帶動儲能、重電等相關供應鏈商機。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">此外，國防預算創新高，同屬政策加持的船艦、飛機，也迎來汰舊換新、升級需求，相關供應鍵在全球景氣下修下受衝擊程度亦小。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">群益投顧副總裁曾炎裕認為，目前留在市場內的資金，交易熱區集中在電動車、車電、能源等領域，擁有題材與量價變化的個股，才有力量驅動股價上漲。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">台新投顧副總經理黃文清指出，本周為中秋節連假前的交易日，預期指數表現空間受限，等待節後，有望看見資金回籠。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">元富投顧總經理鄭文賢表示，美國科技股和半導體面臨下降循環，包括PC、手機、工業市場下滑，也干擾台灣電子股反彈走勢，加上大陸動態清零，四川、上海乾旱缺電，造成停工，電子產業雪上加霜，美中晶片大戰也上演，對科技股的壓力更大。(新聞來源 : 工商時報一李娟萍／台北報導)</p><p><br/></p>',	'/uploads/20220904/f66eabc41088b14616b9e39cf1d15051.jpg',	1662260090,	1662260090),
(18,	'《各報要聞》歐洲央行預期升息3碼',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】歐洲央行（ECB）將在8日召開貨幣政策會議，全球關注ECB的升息幅度。基於通膨前景不斷惡化，該央行官員近來頻頻發表鷹派談話，市場已反映升息2碼的預期，9月初出爐的8月通膨率再創新高後，包括高盛在內的多家投行預估，本次例會將升息3碼。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">ECB7月例會以2碼揭開11年來的首次升息循環，直到不久前，外界還預期本次亦可能升息2碼，但能源價格暴漲不斷推高通膨，也讓央行官員立場逐漸轉向鷹派。官員擔心，即便是長期通膨預期也可能超出歐洲央行2％的目標，意味著對央行打擊通膨的能力失去信心。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">荷蘭央行總裁諾特（Klaas Knot）與愛沙尼亞央行總裁穆勒（Madis Muller）皆表示，9月例會至少應該討論升息3碼，而德國央行總裁納格爾（Joachim Nagel）主張迅速行動，稱先快後慢的「前置升息」（front-loading）有其好處，不能因為擔心潛在經濟衰退而裹足不前。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">歐洲央行管理委員會成員施納貝爾（Isabel Schnabel），以及法國央行總裁戴加洛（Francois Villeroy de Galhau），亦要求強有力或大幅升息。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">歐元區8月通膨升抵9.1％，再創歷史新高，不久後便可能達到兩位數。高盛指出，基於8月通膨率高於預期，加上官員的鷹派言論，預期歐洲央行管理委員會9月將升息3碼。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">此外，凱投宏觀、摩根大通、美國銀行（BoA）、瑞典北歐聯合銀行（Nordea Bank）和荷蘭合作銀行（Rabobank）等，皆預測升息3碼。摩根大通表示，越來越多官員支持強力回應物價飛漲，8月通膨數據讓他們更有理由積極升息。(新聞來源 : 工商時報一顏嘉南／綜合外電報導)</p><p><br/></p>',	'/uploads/20220904/c5d185d838c03aa2a4e9afa448ff80cc.png',	1662260636,	1662260636),
(20,	'《台北股市》焦點股-愛地雅',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報記者郭鴻慧台北報導】自行車組車大廠愛地雅(8933)全球生產基地計畫擴廠與擴產，年產能將擴增3成，多頭攻勢凌厲，上週累計五個交易日股價漲幅高達27.1%。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">愛地雅2022年上半年稅後純益1.67億元，為去年全年度的2倍，EPS達0.56元，賺贏去年一整年，下半年進入自行車出貨高峰期，法人樂觀看待今年全年度的營運表現。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">愛地雅目前全球生產製造基地有四處，包括台灣台中廠、大陸東莞廠、歐洲波蘭廠、越南車架廠，生產基地皆有計劃擴廠與擴產，年產能可望增加3成，2024年產能可望衝破百萬台。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">愛地雅台灣廠目前年產能約25萬台，在擴產完成後，年產能將可提高到35萬台；大陸東莞廠目前年產能約36萬台，未來將把資源聚焦在車架的生產製造上；波蘭廠將加碼投資，預計將興建二廠，完工後兩廠年產能將由6萬台衝高到18萬台、產能提高3倍；至於越南廠第一階段將先接東莞廠車架外溢訂單，下階段計劃興建組車廠，年產能上看12萬台的組車廠。</p><p><br/></p>',	'/uploads/20220904/1b73911c7eba43001bc7ee75b85440e7.jpg',	1662284395,	1662284395),
(21,	'《各報要聞》提振油價 OPEC＋擬討論減產',	'<p>【時報-台北電】石油輸出國家組織與其盟國（OPEC+）5日將召開會議討論油產政策。鑒於OPEC龍頭沙烏地阿拉伯上月曾拋出減產議題，據消息來源透露，與會官員將不排除討論降低產能以支撐油價。\r\n\r\n受可能減產利多激勵，布蘭特油價2日盤中曾一度升破95美元，但隨後擔憂全球經濟成長趨緩與中國再度封城抗疫，導致漲幅受限，終場布蘭特油價僅小漲1％到每桶93.28美元、美國西德州期油也溫和走高0.74％到87.25美元。兩大指標油價周線仍舊收黑，跌幅約為6.1％與4.6％。\r\n\r\n據熟悉OPEC的三名消息人士指出，油市供給依然吃緊、加上擔憂此時提出減產恐將引發政治反彈，OPEC＋在這次會議料將繼續維持產出配額不變。但也有數名官員提到，由於油市前景不明，並不排除進行減產以拉抬油價。\r\n\r\n近來美國聯準會與其他主要央行為打擊通膨大幅調高利率，導致全球經濟陷入衰退風險大幅攀升，加上中國防疫封城，也對石油需求造成衝擊。受此影響，布蘭特油價已從今年高點的120美元大幅回落到每桶93美元附近。\r\n\r\n眼見油價再度走跌，沙烏地阿拉伯能源部長阿卜杜拉齊茲親王（Abdulaziz bin Salman）上月曾拋出減產議題，聲稱油價已與實體市場脫節，無法反映供應基本面，並暗示在9月會議將討論減產以平衡供需。\r\n\r\n沙國減產想法也獲得多個會員國的力挺，阿拉伯聯合大公國與阿曼都表態將支持OPEC+努力維持市場穩定的行動。\r\n\r\n另外伊朗與美國的核協議雖然仍在進行談判，但OPEC+還憂心一旦兩造達成協議，伊朗原油將重回油市，讓原油日產量增加1百萬桶、約占全球供給的1％。\r\n\r\nOANDA高級市場分析師厄蘭（Craig Erlam）指出，伊朗和美國之間的核談判若在近期出現進展，預料將對油價帶來很大下行風險。沙國似乎藉由發出減產，來警告將因應該情況的發生。(新聞來源 : 工商時報一蕭麗君／綜合外電報導)</p>',	'/uploads/20220904/2c6e0065a593e718e270cccb13c6bad7.jpg',	1662284542,	1662284542),
(22,	'《各報要聞》強美元 日圓貶破140恐成常態',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】美國聯準會(Fed)「極鷹派」的貨幣緊縮方向，對全球金融市場的衝擊受各界高度關注。日本瑞穗金融集團瑞穗綜研首席經濟學家太田智之接受本報專訪時指出，美國處於「工資通膨螺旋向上」的邊緣，推高了服務業價格，但更應注意的是，真正的升息效應才要開始。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">美日利差第四季會拉大超過3個百分點，強勢美元對所有非美貨幣，帶來極大壓力，日圓兌美元匯率波動會很大，「衝到140元的上方，也不用太驚訝。」</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">甫公布的美國8月非農就業人口，略低於市場預期，失業率則升至6個月來新高的3.7％，市場推估，Fed將維持現行激進升息步調。太田智之對此的看法是，聯準會主席鮑爾在全球央行年會中的講話，強烈反映對美國持續高通膨的危機感，9月升息3碼概率相當高，瑞穗預判，升息還會繼續，聯邦基準利率到年底將達到4％。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">日銀總裁黑田東彥曾公開回應美國的鷹派貨幣政策，他認為，日本持續貨幣寬鬆之外「別無選項」，肯定需要透過貨幣政策，來達到薪資和物價呈現穩定、甚至持續性揚升。太田智之對此表示，日銀認定近期物價上漲「只是進口價格上漲轉嫁使然」，不是持續型上漲，日銀態度上就不想調整利率，因此，日本和美國的利差，會在今年底進一步擴大，長期利率的利差將在3個百分點。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">太田智之並指出，日本原本就維持寬鬆貨幣政策，日圓兌美元容易偏貶，如今Fed堅定升息的腳步大步邁開，日圓更會持續貶值。日圓持續走貶，兌美元匯率在7月15日貶至138.97，8月1日一度回升到131.64，9/2，之後再度走貶至140.19 。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">太田智之分析，雖先前日圓貶值幅度已對今年至7月的升息有所反應，但Fed真正的升息是「從現在開始」，即9月之後及至明年，據此估測，美元兌日圓將會進一步貶值。瑞穗銀行的第四季平均價位估計約140元，然而，這段時間的波動會很大，短暫衝到140元上方都不必太驚訝。(新聞來源 : 工商時報一陳碧芬／台北報導)</p><p><br/></p>',	'/uploads/20220904/2a786255ed31b6ec522cc91464bbad48.jpg',	1662284595,	1662284595),
(23,	'《各報要聞》歐斷氣攪局 美股周線連三黑',	'<div style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 12px; white-space: normal; width: 1530px; display: flex;\"><div id=\"news_details_content\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px auto; padding: 0px; list-style: none; border: 0px; width: 1453.5px; font-size: 14px; line-height: 24px;\"><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">【時報-台北電】美國就業報告利多消息不敵歐洲天然氣危機憂慮，美股2日開高走低，三大指數寫下周線連三黑紀錄。在股市動盪加劇之際，能源、防禦與高股息類股最受投資人青睞。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">道瓊工業指數2日下挫337.98點或1.07％，以31,318.44點作收；標普500指數亦下跌1.07％，收在3,924.26點，科技股雲集的那斯達克指數下滑1.31％，報11,630.86點。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">三大指數周線連續三周收黑，道指挫低2.99％，標指大跌3.29％，那指重挫4.21％。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">美國8月失業率上升略微緩解聯準會（Fed）持續激進升息的市場憂慮，激勵美股2日開盤急速拉高。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">然而俄羅斯國營天然氣公司Gazprom表示，俄國連接德國的北溪一號管線無法在3日回復供氣，歐洲能源危機雪上加霜，受此影響美股午盤反轉下跌，早盤漲勢全數回吐。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">Horizon投資公司投資組合管理部門主管希爾（Zach Hill）指出，俄國斷氣的消息掩蓋就業報告光芒，歐洲能源危機占據下午的市場焦點，拖累美股走勢。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">分析師亦指出，美國5日適逢勞動節休市，美股在3天連假前交投清淡，亦加劇股市波動。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">8月就業報告顯示，薪資成長低於預期，失業率由3.5％攀升至3.7％，意味著聯準會（Fed）前期快後期慢的「前置升息」政策，開始顯露成效。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">市場焦點接下來轉向9月中出爐的8月消費者物價指數（CPI），此為聯準會在9月20至21日貨幣政策會議前的最後一項重要經濟數據。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">聯準會主席鮑爾先前示警，央行不惜犧牲經濟成長也要對抗通膨，標指自8月中以來下挫9％，回吐部分夏季漲勢。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">在聯準會官員頻頻放鷹，美股波動加劇之際，日常用品、醫療保健和公用事業等產業相對抗跌，吸引投資人搶進。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">能源類股是今年股市的最大贏家，開年迄今累計大漲44％。值得一提的是，能源類股是標指2日唯一收紅類股，上漲1.81％。(新聞來源 : 工商時報一顏嘉南／綜合外電報導)</p></div></div><p><br/></p>',	'/uploads/20220904/c5aa4ccb42243219618dcc2d8ca5e458.jpg',	1662284661,	1662284661),
(24,	'《各報要聞》PC市場冷 全球出貨量衰到明年',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】PC市場明年續跌，品牌廠全面緊縮新品推出，HP（惠普）日前並預告消費和商業需求在下一季度裡需求依然疲軟，加上目前通路庫存水位仍高，接下來將以更激進的促銷策略以加速清庫存，這也將使得PC市場提前進入殺價促銷的價格戰。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">IDC預期消費者信心指數在後續的六個季度將持續惡化，導致消費性PC產品出貨量今、明年度持續衰退，其中2022年度估將下滑近1成後，2023年再以低個位數走跌，並拖累全球PC出貨量由今年度的3.05億台， 跌至明年破3億、降至2.97億台。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">依HP甫公布最近一季（5～7月）的財報來看，PC業務再較上季明顯走滑，包括筆電產品營收季減達15％、桌上型電腦產品營收亦季減11％。對比去年同期，HP筆電出貨量更是大幅年減32％，不過因Chromebook機款比重大舉降低，營收年減幅收斂至10％。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">至於桌機產品則仍因有商用需求帶動，出貨量小幅年增1％、營收年增13％，不過受到總體經濟不佳影響，動能不若原先預期，HP亦透露，短期內不只消費性PC市場需求持續走弱，來自商用市場的訂單需求亦顯疲軟，恐在下一個季度仍呈現衰退趨勢。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">HP的看法與先前陸續發布季報的Dell（戴爾）、Lenovo（聯想）及NVIDIA（輝達）等業者，對PC市場需求看淡一致，同時對於現階段手上存庫偏高、須加速去化調整的策略亦與市場有共識，各業者並將自該季起採行更積極的做法，以大幅降低庫存水位。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">進入下半年以來，PC品牌廠多已明顯收斂在消費型機款的升級新品數量，多為延續既有機款規格變化。若有新發布的新品，則多聚焦在高階、或與市場主流具明顯差異化的產品，如聯想與華碩接連端出的OLED可摺疊螢幕筆電ThinkPad X1 Fold、ASUS Zenbook 17 Flod OLED，與宏碁延伸環保系列的Chromebook Vero 514等。</p><div class=\"caas-da\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><div id=\"sda-INARTICLE\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">IDC認為，消費PC市場的需求趨於飽和，加上全球景氣不佳、通膨等影響，將使得消費PC市場需求直到明年底持續萎縮，至2024年才出現反彈。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">IDC亦再度下修對今年度全球PC市場出貨預測值，其中消費PC估將年減9.9％、降至2.65億台，企業端採購的PC出貨量亦將年減1.6％、低於0.58億台，含括教育及政府部門採購的PC出貨量則年減2成以上、為0.69億台。(新聞來源 : 工商時報一翁毓嵐／台北報導)</p>',	'/uploads/20220905/80aa7189e2878088badb36749bb6fc7d.jpg',	1662341192,	1662341192),
(25,	'《各報要聞》券商公會理事長陳俊宏：創新、數位力齊發打造新市場利基',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】券商公會第九屆會員大會7月底完成改選，由元富證券董事長陳俊宏擔任理事長一職，身為熟稔證券、產業長年發展的沙場老將，他直言，創新及數位力展現，會是全體證券商未來重要發展關鍵，券商公會將積極扮演平台溝通角色，藉由新業務拓展，作大證券市場版圖。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">觀察近年台灣證券市場變化，陳俊宏樂觀認為自金融風暴之後，台股體質良好，動能恢復快速，可說是已經旺了十年以上，包括外資大舉進駐，近年還有台商資金回流，當沖占比一度超過4成，熱度堪稱比肩美股，都可以看出市況相當活絡，且已走向更加成熟的階段。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">陳俊宏說，隨著金融科技（Fintech）蓬勃發展、普惠金融議題發酵，以及主管機關不斷鬆綁交易制度及開放業務，讓證券商有機會「借力」數位科技，進行業務開拓及客戶關係維護，同時也能夠擴大業務規模及業務範疇，發展新市場利基。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">因此，甫接下券商公會總舵手一職，陳俊宏就已定調「創新業務」及「數位金融應用」將是證券業未來重要方向，可望迎來下個「黃金十年」。未來券商公會會積極在此兩大方向上推動相關業務，協助證券商提升業務經營空間，以及跨業競爭力度，增進全體券商共同利益。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">創新業務 讓企業融資更順</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">陳俊宏指出，針對創新業務，券商公會目前除了已經在推動提升交割專戶分戶帳使用效益、縮短盤中零股交易撮合間隔時間、開放複委託融資等制度之外，也正在研議上市櫃公司發行新股時，券商可以提供員工及原股東股款繳納資金融通服務，打通企業籌資環節，提升證券商投行業務服務價值。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">另外，在客戶融通資金方面，朝向總歸戶的概念，協助證券商強化及整合對客戶各項資金融通業務的風險管理。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">在數位金融應用方面，陳俊宏建議，可以加速推動證券商遠距服務可適用身分認證機制，以及擴大客戶於線上進行交割款帳戶設定、出入金及扣款應用模式，提升證券商多元攬客能力，並能享受由數位科技所帶來的紅利。</p><div class=\"caas-da\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><div id=\"sda-INARTICLE\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">建立資安標準 防堵詐騙</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">此外，台股去年交易熱絡，在整體市場量能及投資人數大幅擴增之下，導致資訊安全及金融詐騙等問題層出不窮，造成投資人困擾。陳俊宏指出，券商公會期望能扮演橋樑，有效集結主管機關、金融周邊單位、證券商及第三方資訊業者力量，共同建立一套資安管理標準並全面納入監管，做好全方位資安防護，讓台灣證券市場朝更健全的方向發展。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">力推ESG 實踐社會公益</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">而在追求獲利之外，陳俊宏認為，證券商也應該進一步發揮實踐社會公益的角色，積極推動普惠金融投資。可以藉由推展線上、智能、小額、多元商品及教育等多面向投資友善工作，擴大金融服務覆蓋對象，提供投資人越來越多元的證券商服務。未來將邀請證券同業共同推行ESG，一起積極投入環境、社會和公司治理、擴大企業和產業影響力以達到共好。(新聞來源 : 工商時報一陳昱光、方歆婷／台北報導)</p><p><br/></p>',	'/uploads/20220905/900e2c7b085cebd6b21dc67921b47279.jpg',	1662341667,	1662341667),
(26,	'《各報要聞》廈門通令民用無人機限飛 明令9月12日前未經審批不能起降',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】「廈門公安」微信公眾號3日指出，廈門市公安局為加強投資貿易洽談會舉辦期間的無人機等民用小型航空器管理，從9月3日至12日進行管制，未經審批不得起降。由於金門地區連日來遭大陸民用無人機侵擾，甚至遭我方金門守軍示警、擊落，因此該通告特別受到矚目，有大陸網友直言，此舉將使從廈門飛抵金門的無人機行動被迫暫停。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">總統下令採強力措施 反制無人機</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">近期台海情勢變化下，大陸沿海出現多次民用無人機飛抵金馬等離島，甚至拍攝當地駐守部隊。蔡英文總統曾於上月30日表示，敵軍愈是挑釁，就愈要冷靜，國軍自我克制，但不表示國軍不會反制，她下令：「國軍應適時採強力措施反制中共無人機」，金門守軍在1日首度開槍擊落大陸民用無人空拍機。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">金門守軍2日更在烈嶼貴山海灘發現以垃圾袋包裹的榨菜、滷蛋等食品。袋子上寫著「把最好的，吃不起的茶葉蛋和榨菜，都送給你們」，嘲諷過去某些台灣名嘴在政論節目曾說大陸人吃不起茶葉蛋與榨菜的爭議。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">金防部表示，依國防部「一點生變、連鎖反應、全面制變」指導，各據點官兵時刻監控，發現不明無人機時，執勤官兵立即回報並加強監視，待命班人員則運用干擾槍及7.62公釐口徑以下步槍實施防衛射擊。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">台海敏感時機 廈門通令引發聯想</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">廈門官方3日發布的《通告》為無人機事件再添聯想。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">廈門市公安局與中國民用航空廈門安全監督管理局等單位指出，為確保第22屆中國國際投資貿易洽談會安全順利舉行，根據相關規定，要求對包含輕型和超輕型飛機、輕型直升機、滑翔機、三角翼、滑翔傘、動力傘等有人駕駛航空器；另對無人機、航空模型等無人駕駛航空器，以及熱氣球、飛艇、無人駕駛自由氣球、孔明燈、大型風箏等空飄物進行臨時性管理。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">該《通告》要求，從3日至12日止未經審批，任何單位和個人不得擅自在廈門起降民用小型航空器和升放空飄物，並對違反管制等行為，由有關部門依法處罰，構成犯罪更將依法追究刑事責任。</p><div class=\"caas-da\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><div id=\"sda-INARTICLE\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">該《通告》也強調，如是因緊急救援、氣象探測、人工影響天氣以及投洽會的宣傳，確需起降民用小型航空器和升放空飄物，應按照規定及時報請民航廈門安全監督管理局並會同相關部門審批。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">對於擊落大陸民用無人機一事，大陸國台辦發言人朱鳳蓮日前曾表示，民進黨企圖借機炒作、製造緊張氣氛、升高兩岸對立對抗是極其荒唐與可笑。此次廈門官方的限飛令，則帶有緩解的意味。我方國防部不予評論。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">金門地區在3日與4日未獲報有不明民用無人機的蹤影，但是國防部昨晚指出，至昨天下午5時為止，第一次公布偵獲1架軍用無人機，另有7架共機，其中有3架逾越海峽中線、進入西南空域，並有5艘共艦，在台灣周邊海空域活動，國軍運用任務機、艦及岸置飛彈系統嚴密監控與應處。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">金防部強調，射擊前將謹慎明辨，確認空間射角安全，再予以擊落，避免傷及民眾與其財產。烈嶼守備大隊吳士官長表示，據點官兵將依照國防部政策指導，時刻監控、反制，確維防區整體安全。(新聞來源：中國時報─記者吳泓勳、葉家瑋／綜合報導)</p>',	'/uploads/20220905/047d2f3d518e83c942a4cec8a26aed86.jpg',	1662341865,	1662341865),
(27,	'《晨間解盤》現金為王 1族群下好離手(倫元投顧提供)',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】美股上周四早盤重挫、尾盤拉升收斂跌幅，技術線型留下長下影線，根據技術面分析，這是多頭抵抗的型態，說明美股短期的修正有可能暫告一段落，如矽智財族群，因為該族群的估值是台股中最高的、而且價格也高，這個族群是市場中大戶喜愛操作者，並非一般散戶就能夠推動，也就是說，大內資開始熱身了！</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">其實盤面不只矽智財，另外市場性濃的個股也有點火，如跟車電相關的二極體、低軌衛星、蘋果派等，市場派動作開始積極，則有助於吸引短多人氣回溫。整體分析，目前是法人股弱、內資股強，因為法人股多屬於大型佔權值者，但必須美股配合不再重挫才行，否則一日行情的個股會變多；策略上保留適度現金部位，從長期看好的產業中尋找標的操作：以車電為主、向外擴散。(倫元投顧提供)</p><p><br/></p>',	'/uploads/20220905/7d2aa9fe632cc2ffd7ac67d45149d269.jpg',	1662342166,	1662342166),
(28,	'《台北股市》內資控盤 17檔人氣不墜',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】台股內資控盤，資金往中小型股集結，投信、中實戶及主力多頭勢力進場，維繫人氣的不墜。考量國安基金護盤及美股科技股波動劇烈，台股分析師建議資金往內資色彩濃厚的個股布局，包括元晶（6443）等17檔個股有撐。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">永豐投顧總經理李學詩認為，國安基金宣布進場護盤的7月低點到波段高點，反彈了1,547點，但是大病不可能即刻痊癒，目前全球仍受制於美國急速升息、企業高庫存、全球高通膨等的干擾，台股最佳的方式是回檔之際打出第二隻腳，或可能形成三重底。目前反彈強弱勢觀察，最宜要守住0.382的位置14,519點，形成雙底，若是往頭肩底型態發展，回檔壓力將沉。考量美股等國際股市表現不佳，台股本周指數將持續震盪，中小型股表現機會仍大。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">展望本周的個股表現，依據法人的選股建議條件，挑選今年7月合併營收比去年同期成長、股價在月線之上、投信買超、周量增及上周股價抗跌的個股依序有元晶、光寶科、燿華、台半、和大、眾達-KY、中美晶、元太、振樺電、聚陽、系統電、東陽、茂順、世芯-KY、明安、寶雅、M31等個股。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">台新投顧副總黃文清認為，投信多方資金偏愛的個股以下半年具有營運題材的如電動車、太陽能、汽車零組件、IP矽智財、內需零售、紡織、網通、電子標籤等個股，部分個股已是投信高持股，其他個股是投信才開始建立持股水位，投資人留意投信的資金變化。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">世芯-KY、M31為IP矽智材股，其中世芯-KY日前召開法說會，公司釋出的營運展望令法人驚喜，直指車用高效能運算（HPC）、人工智慧（AI）專案加速提升，先進駕駛輔助系統（ADAS）與車用資料中心兩應用領域也陸續進行，世芯-KY的利多帶領其他IP股同步走揚。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">和大、東陽、茂順等為汽車零組件大廠，美系特斯拉展望樂觀及台系電動車LUXGEN新世代純電休旅車即將上市，將提升台系汽車零組件的營運力道，其中和大第二季獲利創11季來新高，7月合併營收創歷年同期新高紀錄。(新聞來源 : 工商時報一王淑以／台北報導)</p>',	'/uploads/20220905/03beeaa5a79025b433b79e39a04972bf.jpg',	1662342259,	1662342259),
(29,	'《台北股市》9月2日股市備忘錄',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】9月2日股市備忘錄：</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊除權息交易：達新、車王電、訊聯、建大、可成、崧騰、創源、全球傳動、日成-KY、華容、邑錡。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊法說會：大億、基士德-KY、志強-KY、光隆。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊減資後新股掛牌：保銳。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊增資股買賣：立益物流、聯邦銀、康呈、長科*、天宇。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊注意股票：威盛、可成、世芯-KY、祥碩、中天、創惟等。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊處置股票：新世紀。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊恢復原融資比率及融券保證金成數：展宇、六暉-KY、寶一、泰昇-KY、業強、崑鼎。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊降低融資比率1成及提高融券保證金1成：科定、德勝、久威。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊暫停融券賣出（融券最後回補）：綠河-KY、點序、華電網。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">＊恢復融券賣出：訊聯、崧騰、華容、長科*。(新聞來源 : 工商時報一柯宗沅輯)</p>',	'/uploads/20220905/047d2f3d518e83c942a4cec8a26aed86.jpg',	1662342380,	1662342380),
(30,	'《台北股市》元晶、友達獲投信認養 吸金',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】時序接近第三季底，作帳行情在9月底前將逐步放大對股市的影響力，尤其2022年以來投信作為多頭總司令，截至2日止已連續買超台股51個交易日，累計金額高達719.54億元，元晶（6443）、友達（2409）等投信認養股順勢借力。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">投信9月以來累計買超前兩大為元晶及友達，分別買超1.77萬張與8,430張，且持股比率均低於10％，未來仍有加碼空間。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">進入下半年傳統旺季，元晶除有政策面支持，包含下半年躉購費率維持與上半年相同，大型案場的加速建置獎勵機制，同時下半年訂單也將以浮動報價反應成本，獲利或將翻倍成長。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">此外，元晶取得特斯拉旗下太陽能公司SolarCity訂單，配合美國政府通過的「降低通膨法案」，太陽能裝置加速建設，下半年可望放量出貨。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">另外，具備減資題材的友達，因大陸四川限電令，衝擊中系面板廠，產業庫存有望加速去化，加上市場傳出三星的電視面板將逐步恢復正常拉貨，友達營運有望走出谷底。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">友達擬現金減資兩成，每股退還2元，減資後股本為769.94億元，9月23日為融券最後回補日，但截至2日止，融券餘額仍有3.46萬張，潛在軋空行情值得期待。(新聞來源 : 工商時報一柯宗沅／台北報導)</p>',	'/uploads/20220905/bcf7a0aecc371d31d4bf65e0377eb1ad.jpg',	1662342640,	1662342640),
(31,	'中秋變盤？三大名師點名題材股：免驚',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">美股回落及外資賣超效應，「中秋變盤」成為市場熱議焦點。三大投資專家認為，在國安基金護盤及季底作帳效應，中秋變盤壓力不大，9月台股可望力守頸線14,500點，有機會彈上月線15,147點到5月低檔15,616點，看好網通、IP、電動車及汽車零組件、蘋果供應鏈等題材類股。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">統計過去15年中秋前後表現，台股節後上漲機率高於節前，康和證券投資總監廖繼弘指出，美聯準會貨幣政策偏鷹，10年公債殖利率上升至3.2％，美股四大指數拉回跌落季線整理，且美國禁止輝達及超微超級電腦晶片銷陸，影響科技股表現；國安基金低檔護盤支撐信心，台股低檔有撐及融資餘額仍在低檔，蘋果即將發表新機。整體研判9月為14,500點頸線到月線15,147點震盪整理格局。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第一金投顧董事長陳奕光認為，美股走弱及外資持續賣超，外資今年來累計賣超逾1.1兆元，但內資投信連續買超、政府基金加碼以及國安基金護盤，近期盤面呈現集中市場弱勢及櫃買市場強勢，中小型股優於權值股也將是9月主旋律。預期9月盤勢將反覆拉回及反彈走勢，指數下檔守14,500點，上檔突破月線有機會上看15,616點。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">統一投顧董事長黎方國表示，Fed 9月可能再升息3碼，但物價指數見頂將緩步下降，國安基金持續護盤，而中國政府加碼經濟刺激，企業有庫存調整拉貨動能減弱，以及晶圓代工業進入跌價周期等多空因素，影響9月盤勢區間震盪，指數將介於14,600點到15,400點。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">黎方國看好汽車零組件股、生技股、蘋果新機發表受惠股。廖繼弘認為，現階段逢回選股不選市操作，反彈減碼彈不過季線弱勢股。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">陳奕光表示，9月選股看好受惠新台幣貶值的鞋類、自行車、高爾夫球桿、汽車零組件，政策加持的綠能、航太、低軌道衛星，以及產業前景佳的電動車及充電樁等。</p><div class=\"caas-da\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><div id=\"sda-INARTICLE\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><span style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\">更多工商時報報導</span><br/><a href=\"https://www.chinatimes.com/newspapers/20211222000181-260204?utm_source=yahoo_news&utm_medium=rss\" target=\"_blank\" class=\"link \" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; color: rgb(0, 0, 0);\">訊連人臉辨識 明年貢獻營收</a><br/><a href=\"https://www.chinatimes.com/newspapers/20211223000145-260203?utm_source=yahoo_news&utm_medium=rss\" target=\"_blank\" class=\"link \" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; color: rgb(0, 0, 0);\">惠譽看人民幣 明年貶至6.7元</a><br/><a href=\"https://www.chinatimes.com/newspapers/20211223000115-260202?utm_source=yahoo_news&utm_medium=rss\" target=\"_blank\" class=\"link \" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; color: rgb(0, 0, 0);\">台灣本田首款國產油電車 逆勢降價</a></p><p><br/></p>',	'/uploads/20220905/b50779277bb9986785fde250857ab3bb.jpg',	1662342908,	1662342908),
(33,	'《晨間解盤》軍演低點迫近 3族群重兵埋伏(國票投顧提供)',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】美國公佈8月非農報告，失業率3.7%，略高於預期的3.5%，有望緩解Fed大幅升息的可能性，美股一度上漲，然而盤中時段傳出，北溪一號的維修期限已到，但俄羅斯卻持續關閉管線，消息衝擊市場，美股四大指數由紅翻黑，最終全數收低，幅度介於-1.02%至-1.31%，台積電ADR-0.91%，台指期夜盤-33點(-0.23%)，預期今日台股小幅開低，但先前中國軍演低點14545應有支撐，盤勢有望震盪回升，聚焦高爾夫球、網通、IP矽智財。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">有鑑於台股KD指標的K值僅剩15，數值進入超賣區，隨時會有跌深反彈的可能性，再者，指數當前點位14673，與先前中國軍演的低點14545相當接近，此為多方重要防線，預期會有強力買盤坐鎮，此處不需急著殺出，若大盤還有開低，反而是趁亂搶進強勢股的好時機。操作方面，聚焦高爾夫球，類股幾乎不受盤勢干擾，出現族群性的行情，且擁疫後復甦題材，短線應有續強契機，另網通、IP矽智財逆勢上漲，亦可留意。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">由於美元指數直逼110，改寫20年來的新高，加上歐洲央行ECB看法轉鷹，且將於9/8(四)舉行利率決議，市場推測，歐元區將跟上美國的腳步，本次很可能升息3碼，須格外留意，不過，考量本週除9/7(三)蘋果新品發表會外，也是台股8月營收的密集公佈期，業績成長的個股，有望獲得買盤進駐並率先回穩，可多加關注，此外，9/13(二)美國將公佈CPI，短線波動恐持續放大，建議可陸續轉往生技股、反向ETF等避險性質標的，以因應盤勢的快速變化。(國票投顧提供)</p><p><br/></p>',	'/uploads/20220905/eee33db5bce3392a633ff1a7ec1e288f.jpg',	1662343162,	1662343162),
(34,	'【統一證券晨訊】台股預期觀望氣氛濃 宜保守操作',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">日期：2022年 9月 5日</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※盤勢分析</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">中秋長假將至、市場不確定性高，建議保守操作</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※昨日盤勢</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">受到前一日美國科技股表現疲弱影響，上周五台股以下跌12點的14790點開</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">出後，台積電、聯發科等大型電子權值股呈現下跌走勢，貨櫃三雄的賣壓也相當</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">大，長榮、陽明、萬海皆重挫逾6%，衝擊台股投資人信心，盤中指數震盪走低跌</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">破14700點，盤面上以生技族群、IP矽智材、伺服器、網通、高爾夫球等中小型</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">族群表現較為強勢，午盤過後賣壓持續湧現，終場指數下跌128點，以14673點作</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">收，成交量能為2343億元。觀察盤面變化，三大類股全數下跌，其中電子、傳產</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">及金融分別下跌0.79%、1.19%及0.53%。在次族群部份，以生技醫療、紡織、營</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">建表現較佳，分別上漲2.22%、0.3%及0.11%。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※資金動向</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">三大法人合計賣超173.16億元。其中外資賣超146.32億元，投信買超5.52億</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">元，自營商賣超32.42億元。外資買超前五大為宏達電、統一實、欣興、力積電</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">、景碩；賣超前五大為新光金、華航、開發金、台積電、中信金。投信買超前五</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">大為元晶、友達、華新、永豐金、燿華；賣超前五大為欣興、世紀鋼、南電、台</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">灣大、上緯投控。資券變化方面，融資增1.17億元，融資餘額為1952.41億元，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">融券增0.16萬張，融券餘額為61.56萬張。外資台指期部位，多單減碼7231口，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">淨多單部位6059口。借券賣出金額為95.88億元。類股成交比重：電子69.74%、</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">傳產27.31%、金融2.95%。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※今日盤勢分析</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">聯準會(Fed)主席鮑威爾在傑克森霍爾年會發表鷹派言論，造成美股全面重</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">挫，目前市場預期九月下旬FOMC會議將升息3碼，通膨、升息影響資本市場的警</p><div class=\"caas-da\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><div id=\"sda-INARTICLE\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">報並未解除，系統性風險升溫。本周中秋連假將至，台股預期觀望氣氛轉濃。台</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">股後市分析如下：</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第一、上周五美國8月非農新增就業為31.5萬人，略高於市場預期的30萬人</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">，不過創下2021年4月以來最低增幅，8月失業率為3.7%，高於市場預期，失業率</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">上升可能緩解聯準會9月激進升息的壓力，根據CME Fedwatch，交易員預計聯準</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">會在9月下旬的利率會議上，仍維持升息3碼的機率有60%，略低先前的70%，後續</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">關注8月份CPI數據。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第二、財政部週三( 7)將公布8月進出口統計，排除外在因素並以季節性因</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">素推估，預估8月出口值約將落在427億到442億美元區間，出口年增幅約在</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">8%~12%左右，將呈現連續26個月正成長，單月出口仍有望擠進歷年前三大，甚至</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">有望改寫單月新高紀錄。不過，目前全球經濟仍受疫情反覆、通膨升溫與地緣政</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">治緊張等影響，讓產業庫存調整壓力大增，對於後市展望也偏向保守，下半年出</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">口增幅將收斂。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第三、上週指數下跌605點，周線連二黑，目前指數跌落所有均線之下，短</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">期均線再次呈現空頭排列，且跌破前低14843，型態上也轉弱，加上外資賣超不</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">斷，指數未重新站上短均線之前，建議保守觀望。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第四、美中科技戰影響，台灣矽智材(IP)廠商可望受惠，M31、晶心科、世</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">芯- KY、創意、智原等股價逆勢走揚。生技股在盤勢不穩時成為資金避風港，智</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">擎、合一、台康、永昕、中化生、國光生等短線偏多。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※投資策略</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">聯準會官員不斷放鷹，市場預期九月下旬FED將升息三碼，加上美國維持對</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">中關稅，且俄國關閉北溪一號天然氣供應等因素干擾，國際股市表現疲弱。台股</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">指數上週再度跌落所有均線之下，型態轉弱，加上本週中秋連假將至，預期觀望</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">氣氛轉濃，在指數未站上短均線之前，建議保守觀望，嚴控持股水位。操作上建</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">議以綠能/儲能、新能源車、汽車零組件及生技等防禦型選股為主。</p>',	'/uploads/20220905/595142e878e8f7458deeb0077ab9bfdc.jpg',	1662343313,	1662343313),
(35,	'《晨間解盤》台股弱勢 恐測低點14545點',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】上周五大盤持續探低，終場加權股價指數數下跌128.82點，收在14673.04點，成交值為2311.11億元。投顧預估8月4日低點面臨測試。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">凱基投顧表示，加權股價指數數再創本波拉回新低14673點，短線呈現震盪走低的態勢，並且處於所有均線之下，技術面格局呈現弱勢整理；就格局來看，頸線反壓約15095點沒克服前，盤勢處於劣勢，後續要提防8月4日低點14545點測試的風險。周KD向下交叉，指數後續破底下探，是本波段空頭走勢慣性，本周應特別注意周隨機指標是否向下交叉。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">當前操作宜謹慎，持股汰弱留強，積極者短多操作應預設損益點，聚焦技術面多方結構未遭破壞，利多題材發酵等近期相對大盤強勢的族群個股。（編輯：沈培華）</p>',	'/uploads/20220905/8f168292008b8d476836d1cdc4d4ce15.jpg',	1662344967,	1662344967),
(36,	'統一證券晨訊】台股預期觀望氣氛濃 宜保守操作',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">日期：2022年 9月 5日</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※盤勢分析</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">中秋長假將至、市場不確定性高，建議保守操作</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※昨日盤勢</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">受到前一日美國科技股表現疲弱影響，上周五台股以下跌12點的14790點開</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">出後，台積電、聯發科等大型電子權值股呈現下跌走勢，貨櫃三雄的賣壓也相當</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">大，長榮、陽明、萬海皆重挫逾6%，衝擊台股投資人信心，盤中指數震盪走低跌</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">破14700點，盤面上以生技族群、IP矽智材、伺服器、網通、高爾夫球等中小型</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">族群表現較為強勢，午盤過後賣壓持續湧現，終場指數下跌128點，以14673點作</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">收，成交量能為2343億元。觀察盤面變化，三大類股全數下跌，其中電子、傳產</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">及金融分別下跌0.79%、1.19%及0.53%。在次族群部份，以生技醫療、紡織、營</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">建表現較佳，分別上漲2.22%、0.3%及0.11%。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※資金動向</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">三大法人合計賣超173.16億元。其中外資賣超146.32億元，投信買超5.52億</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">元，自營商賣超32.42億元。外資買超前五大為宏達電、統一實、欣興、力積電</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">、景碩；賣超前五大為新光金、華航、開發金、台積電、中信金。投信買超前五</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">大為元晶、友達、華新、永豐金、燿華；賣超前五大為欣興、世紀鋼、南電、台</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">灣大、上緯投控。資券變化方面，融資增1.17億元，融資餘額為1952.41億元，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">融券增0.16萬張，融券餘額為61.56萬張。外資台指期部位，多單減碼7231口，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">淨多單部位6059口。借券賣出金額為95.88億元。類股成交比重：電子69.74%、</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">傳產27.31%、金融2.95%。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※今日盤勢分析</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">聯準會(Fed)主席鮑威爾在傑克森霍爾年會發表鷹派言論，造成美股全面重</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">挫，目前市場預期九月下旬FOMC會議將升息3碼，通膨、升息影響資本市場的警</p><div class=\"caas-da\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><div id=\"sda-INARTICLE\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">報並未解除，系統性風險升溫。本周中秋連假將至，台股預期觀望氣氛轉濃。台</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">股後市分析如下：</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第一、上周五美國8月非農新增就業為31.5萬人，略高於市場預期的30萬人</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">，不過創下2021年4月以來最低增幅，8月失業率為3.7%，高於市場預期，失業率</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">上升可能緩解聯準會9月激進升息的壓力，根據CME Fedwatch，交易員預計聯準</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">會在9月下旬的利率會議上，仍維持升息3碼的機率有60%，略低先前的70%，後續</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">關注8月份CPI數據。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第二、財政部週三( 7)將公布8月進出口統計，排除外在因素並以季節性因</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">素推估，預估8月出口值約將落在427億到442億美元區間，出口年增幅約在</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">8%~12%左右，將呈現連續26個月正成長，單月出口仍有望擠進歷年前三大，甚至</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">有望改寫單月新高紀錄。不過，目前全球經濟仍受疫情反覆、通膨升溫與地緣政</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">治緊張等影響，讓產業庫存調整壓力大增，對於後市展望也偏向保守，下半年出</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">口增幅將收斂。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第三、上週指數下跌605點，周線連二黑，目前指數跌落所有均線之下，短</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">期均線再次呈現空頭排列，且跌破前低14843，型態上也轉弱，加上外資賣超不</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">斷，指數未重新站上短均線之前，建議保守觀望。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第四、美中科技戰影響，台灣矽智材(IP)廠商可望受惠，M31、晶心科、世</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">芯- KY、創意、智原等股價逆勢走揚。生技股在盤勢不穩時成為資金避風港，智</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">擎、合一、台康、永昕、中化生、國光生等短線偏多。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※投資策略</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">聯準會官員不斷放鷹，市場預期九月下旬FED將升息三碼，加上美國維持對</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">中關稅，且俄國關閉北溪一號天然氣供應等因素干擾，國際股市表現疲弱。台股</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">指數上週再度跌落所有均線之下，型態轉弱，加上本週中秋連假將至，預期觀望</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">氣氛轉濃，在指數未站上短均線之前，建議保守觀望，嚴控持股水位。操作上建</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">議以綠能/儲能、新能源車、汽車零組件及生技等防禦型選股為主。</p>',	'/uploads/20220905/bcf7a0aecc371d31d4bf65e0377eb1ad.jpg',	1662345211,	1662345211),
(37,	'券商晨訊台股投資建議摘要 (1) 2022年9月5日',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【統一證券】</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">在指數未站上短均線之前，建議保守觀望，嚴控持股水位。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">操作上建議以綠能/儲能、新能源車、汽車零組件及生技</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">等防禦型選股為主。</p>',	'/uploads/20220905/408b3e75c5af0cd8d1e0e93a631c6ce9.jpg',	1662345542,	1662345542),
(41,	'《盤前掃瞄-國外消息》美元指數升破110；鮑爾9/8演說',	'<div style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 12px; white-space: normal; width: 1280px; display: flex;\"><div id=\"news_details_content\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px auto; padding: 0px; list-style: none; border: 0px; width: 1216px; font-size: 14px; line-height: 24px;\"><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">【時報-盤前掃瞄】國外消息：</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">1.美元指數升破110 刷新20年最高。俄羅斯國營能源巨擘Gazprom宣布無限期停止北溪一號對歐洲的天然氣供應，歐洲能源危機急遽升高，周一摜壓歐元貶破0.99美元支撐，創20年新低；美元對英鎊與日圓等主要貨幣也均走堅，美元指數一舉升破110大關。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">2.人行阻貶 降外匯存準率8碼。人民幣兌美元匯價近月來跌跌不休，朝7元整數關卡進逼。中國人民銀行5日終於出手阻貶，宣布自9月15日起大舉調降金融機構外匯存款準備金率2個百分點（8碼），這是人行年內第二度下調外匯存準率，約向市場釋出190億美元（約5,833億台幣）的流動性。人行宣布後，離岸價一度跳升200個基點至6.93元附近。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">3.又見鷹蹤？鮑爾9/8演說掀牌。美國聯準會（Fed）主席鮑爾（Jerome Powell）8日將發表演說，由於這是他自8月26日全球央行年會後的首度公開談話，在美國就業市場已現趨緩跡象，市場欲從鮑爾本周演說內容，尋找Fed是否在本月例會仍將堅持升息3碼訊息。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">4.英新首相特拉斯 拚突圍經濟風暴。英國外相特拉斯（Liz Truss）在保守黨黨魁大選中擊敗蘇納克，確定將取代強生，成為英國新首相，將帶領英國克服通膨破表的經濟風暴。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px;\">5.救經濟 廣東頒布穩工業7條。大陸仍未走出4～5月疫情後的經濟陰霾，近期多地繼續大力度推出新的穩經濟、促消費措施。如廣東近日頒布「穩工業7條」措施加大基建與復產力度，發改委也喊話要求各地方加速在第三季推出重要政策，預期9月各省市還將陸續推出新措施。</p></div></div>',	'/uploads/20220906/68ca37b434dc8a67e3a89fff28f8727c.jpg',	1662427061,	1662427061),
(42,	'《晨間解盤》觀望氛圍 狹幅震盪(國票投顧提供)',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】美股週一因勞動節休市，不過美期照常交易，三大期指均以小漲作收，今天早盤仍延續漲勢持續開高，目前漲幅都在0.4%上下，至於台指期夜盤同樣表現不大，終場小漲27點(+0.18%)作收，預期台股將以平高盤開出，盤中維持狹幅震盪，走勢仍偏觀望。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">台股週一開低後震盪走低，儘管台積電、中鋼、台塑集團及部份金控股早盤稍有表現，一度試圖拉抬指數向上，惟中小型股賣壓沉重，開盤不久隨即走弱，加上新台幣盤中重貶刷新3年新低，熱錢持續撤出疑慮升高，導致台股欲振乏力，終場小跌11點(-0.08%)，以14661點再度創下波段新低。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">觀察週一櫃買指數開盤後隨即拉回，且在尾盤跌勢加重，以致終場收跌1.5%，似乎中小型股歷經之前的漲勢後，已出現較大的調節壓力，連帶波及集中市場，短線上應稍加留意此情況是否有擴大跡象。操作方面，可聚焦面板、太陽能族群，前者具現金減資及面板報價可望觸底題材，後者具市場熱度及技術面、籌碼面優勢，股價續有表現空間，可持續留意。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">美元週一一度觸及110大關，再創20年來的新高，加上歐洲央行ECB看法轉鷹，即將於9/8(四)舉行利率決議，推估歐元區將跟上美國的腳步，本次很可能升息3碼，須格外留意，另考量本週除9/7(三)蘋果新品發表會外，也是台股8月營收的密集公佈期，業績成長的個股，有望獲得買盤進駐並率先回穩，可多加關注。此外，9/13(二)美國將公佈CPI，短線波動恐持續放大，建議可陸續轉往生技股、反向ETF等避險性質標的，以因應盤勢的快速變化。(國票投顧提供)</p>',	'/uploads/20220906/bbb721c6b23562d5fccb9c6e468589c7.jpg',	1662427172,	1662427172),
(39,	'《盤前掃瞄-基本面》大立光營收連三月雙升；鴻海8月業績月減5.51％',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】基本面：</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">1.前一交易日新台幣以30.710元兌一美元收市，貶值1.22角，成交值為12.28億美元。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">2.集中市場05日融資減為1939.92億元，融券增為624901張。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">3.集中市場05日自營商賣超18.40億元，投信買超6.63億元，外資賣超30.48億元。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">4.大立光重返股王寶座，營收也展現股王的氣勢，8月營收順利繳出連三個月雙成長的成績，也帶動累計營收與去年的差距快速收歛到只剩5.37％的些微差距，蘋果光普照，果然讓大立光放寬心。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">5.伺服器遠端管理晶片（BMC）廠信驊（5274）8月合併營收4.03億元，累計今年前八月合併營收34.07億元，年成長幅度48.1％。法人指出，信驊下半年營運可望先蹲後跳，全年營收挑戰年增四成以上。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">6.鴻海5日公布8月營收4,489.06億元，以月減5.51％、年增12.21％，寫下歷年同期新高。另累計前八月營收為3兆8,426.1億元，也超越去年同期、年增9.21％，同步寫下同期新高。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">7.佳世達（2352）集團8月合併營收出爐，8月合併營收約198.99億元，較去年同期178億元成長12％，續創同期新高。累計今年前8月合併營收1639.6億元，比去年同期的1434億元增加206億元，年成長14.4％。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">8.IC設計服務廠創意（3443）公告8月合併營收達20.14億元，寫下單月歷史新高。法人表示，創意下半年在委託設計（NRE）及特殊應用晶片（ASIC）等挹注業績帶動下，第三季營運可望挑戰單季新高水準，全年營收將可望年成長4成，並且再創新高。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">9.不受大環境逆風因素干擾，信邦（3023）營收再創新高，5日公布8月營收27.38億元、月增3.11％、年增23.44％，累計前八月營收達198.58億元、年增17.44％，續創歷年同期新高。</p><div class=\"caas-da\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><div id=\"sda-INARTICLE\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">10.全球貿易需求減弱，散裝航商慧洋-KY（2637）5日公布8月合併營收20.73億元，月減11.51％、年增21.35％，雖守住20億元關卡寫同期新高，卻連三個月衰退，自結單月稅前盈餘8.04億元，月減19.6％、年增16.78％，每股稅前盈餘1.08元。(新聞來源：工商時報、財經內容中心綜合整理)</p>',	'/uploads/20220906/34c2b3021101c231b39a8dba44be273f.jpg',	1662426908,	1662426908),
(40,	'《盤前掃瞄-國內消息》外資前八月淨匯出逾5000億元；新台幣貶破30.7',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】國內消息：</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">1.中秋長假效應及聯準會（Fed）主席鮑爾談話前夕，台股多空縮手觀望，單日成交值再度跌破2,000億元，指數維持在平盤附近狹幅震盪。金管會主委黃天牧5日坦言，近期交易量在2,000億元左右，「是需要關注的一個量」，目前正緊盯台股動能、價格及成交量變化，在穩定台股的前提下，會適時推出必要措施。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">2.美國持續不斷升息，加上地緣政治因素，外資從6月到8月連續三個月淨匯出，據金管會5日公布，8月外資淨匯出54.54億美元，約當新台幣1,655億元，連續三個月合計更已流出130.75億美元（約新台幣3,932億元），無論是6到8月或前八月的外資淨匯出量，都創同期最大淨匯出量，比2008年金融海嘯時更大。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">3.國際美元指數衝破110，外資熱錢持續賣股落跑，讓新台幣應聲重挫，5日連破30.6元及30.7元二關，終場收在30.71元的近三年新低，單日貶值1.22角，總成交量增至16.84億美元的近半個月最大量。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">4.中央銀行5日公布8月底外匯存底為5,454.28億美元，月減23.29億美元，央行外匯局局長蔡?民表示，主要是美元強勢，歐元等貨幣對美元重貶，折計成美元後減少。且央行為維持匯市秩序進場拋匯調節（阻貶），也讓外匯存底餘額減少。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">5.美國升息太鷹、美股四大指數上周跌落季線下、美10年期公債殖利率飆高至3％以上、新台幣重貶、外資今年累計匯出逾5,000億元，多重利空當頭，高成長、高本益比的高價股成重災區，台股剩四千金，沒有900元俱樂部，連500元以上的高價股僅剩16檔，與高峰時幾近腰斬。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">6.市場傳出台積電將在大阪設立第二座研發基地，不過台積電5日回覆指出，並非增設研發中心，而是日本設計中心（TSMC Japan Design Center，JDC）要在大阪設立新辦公室。</p><div class=\"caas-da\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><div id=\"sda-INARTICLE\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">7.缺貨多年的辦公市場明年終於可望解渴，統計顯示，台北市中心2023年將有七大指標辦公大樓陸續完工落成，總計面積將有7.4萬坪，可望是16年以來最大量。其中「富邦A25」、「皇翔台汽北站」，分別可望挑戰東、西區區域租金新高。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">8.商業發展研究院5日公布商業服務業景氣預測及分析，顯示下半年來雖因疫情緩和，「報復性消費」助力，但輸入型通膨下，國民實質購買力仍難提高，所幸先前「預期上漲心理」持續上揚的房價已見平息，實質不動產及住宅服務業GDP雖仍微幅成長，但景氣循環趨勢持續走緩，有助通膨預期降溫。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">9.市調9月上旬面板報價出爐，面板價格跌幅持續收斂，65吋以下的電視面板單月跌幅收斂到5美元以下，驅動IC等零件價格鬆動，面板廠也推出43吋成本優化版本刺激需求，推動43吋面板報價跌破50美元，來到歷史低點。整體來看，第三季電視面板價格平均跌幅約10％～15％，第四季價格跌幅有機會縮減到個位數。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">10.瑞信論壇與蘋果秋季發表會聯袂送暖台股之際，多空爭論卻一波未平、一波又起，匯豐證券在全球市場範圍中降評台股至「減碼」，所持三大理由除擔憂全球經濟、兩岸關係外，還包含因指數中所含成分市場不同因而「代替南韓遭殃」的非戰之罪，市場看法兩極。(新聞來源：工商時報、財經內容中心綜合整理)</p>',	'/uploads/20220906/bdd46deacb60509c1e4100b22f4bb5a5.jpg',	1662426985,	1662426985),
(43,	'【統一證券晨訊】均線空頭排列 整理期恐拉長',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">日期：2022年 9月 6日</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※盤勢分析</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">均線空頭排列、整理期拉長，謹慎操作</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※昨日盤勢</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">受到美股上周五美股持續重挫影響，昨日台股以小跌2點14670點開出後，雖</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">然一度拉升至上漲80點，至14753點；但很快賣壓湧入，指數持續拉回至跌破平</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">盤，但維持在平盤附近震盪，跌勢並無進一步擴大。權值股中以台積電、聯發科</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">、台達電、廣達、華碩、和碩及南電等小有表現；強勢股仍以不佔權值的生技股</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">醣聯、北極星、景岳、懷特、中裕等，領漲表現。終場指數小跌11點，以14661</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">點作收，成交量能為1881億元。觀察盤面變化，三大類股漲跌互見，其中電子、</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">傳產分別下跌0.21%、0.1%，金融上漲0.57%。在次族群部份，以電器、資訊服務</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">、觀光等走勢最弱，分別下跌2.04%、1.39%及1.11%。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※資金動向</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">三大法人合計賣超45.1億元。其中外資賣超30.6億元，投信買超3.9億元，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">自營商賣超18.4億元。外資買超前五大為陽明、友達、永豐金、群創、長榮；賣</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">超前五大為宏達電、華航、力積電、玉山金、華晶科。投信買超前五大為元晶、</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">友達、永豐金、眾達、仁寶；賣超前五大華通、上緯、鴻海、智易、南電。資券</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">變化方面，融資減12.5億元，融資餘額為1939億元，融券增0.93萬張，融券餘額</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">為62.4萬張。外資台指期部位，多單加碼3716口，淨多單部位7388口。借券賣出</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">金額為66億元。類股成交比重：電子70.5%、傳產25.5%、金融3.8%。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※今日盤勢分析</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">聯準會(Fed)主席鮑威爾在傑克森霍爾年會發表鷹派言論，造成美股全面重</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">挫，目前市場預期九月下旬FOMC會議將升息3碼，通膨、升息影響資本市場的警</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">報並未解除，系統性風險升溫。本周中秋連假將至，台股預期觀望氣氛轉濃。台</p><div class=\"caas-da\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\"><div id=\"sda-INARTICLE\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; list-style: none; border: 0px;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">股後市分析如下：</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第一、預期聯準官員談話維持鷹派論調，繼續打壓市場風險偏好。本周相當</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">多FED官員談話，包括周三(7)克里夫蘭銀行總裁梅斯特(偏鷹派)；周四(8)鮑威</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">爾(鷹派)、副主席布雷?德(可能鴿轉鷹)；周五(9)芝加哥銀行總裁艾文斯(可能</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">鴿轉鷹)，在鮑威爾定調下，預期將有偏鷹派的發言。而CPI單月數據下滑，不足</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">以影響聯準會的貨幣決策，9月升息3碼的機率仍高，升息循環的終點目前亦維持</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">在3.75%-4%。這個終點在9/22的FOMC會議前，可能隨時會再上調。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第二、台灣八月出口值，有機會挑戰單月新高。財政部將在周三(7)，公布8</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">月進出口統計，在iPhone 14新機上市的拉貨期，與全球車用晶片需求旺盛，預</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">估今年8月出口值上看427億～442億美元，有機會改寫歷年單月出口規模新高，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">與最強8月紀錄，年增率約8％～12％。以出口正成長紀錄觀察，8月份出口估維</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">持正成長，這將創下連26紅紀錄。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第三、均線空頭排列、整理期拉長。台股持續盤跌，未有重量權值股拉盤。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">目前台股各均線呈現空頭排列，上檔明顯壓力在季線14987點位置，在季線持續</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">向下牽引下，原本已經轉上的月線，也受其影響轉而向下。在台幣超級弱勢下，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">外資持續賣超，盤勢不容樂觀。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">第四、題材股匯集人氣，生技股成最佳避風港。在利多訊息簇擁下，生技股</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">在北極星的領軍持續創高下，三顧、明達醫、醣聯、熱映、濟生、晉弘、邦特、</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">景岳、太景及益得等走強明顯。其他如其陽、矽瑪、映興、瑞智等也表現強勢。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">※投資策略</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">聯準會官員不斷放鷹，市場預期九月下旬FED將升息三碼，加上美國維持對</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">中關稅，且俄國關閉北溪一號天然氣供應等因素干擾，國際股市表現疲弱。台股</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">指數跌落所有均線之下，型態轉弱，上檔壓力重。加上本週中秋連假將至，預期</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">觀望氣氛轉濃，在指數未站上短均線之前，建議保守觀望，嚴控持股水位。操作</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">上建議以綠能/儲能、新能源車、汽車零組件及生技等防禦型選股為主。</p>',	'/uploads/20220906/e4fabd61f2ece01a4aff0400f8c36e3b.png',	1662427532,	1662427532),
(44,	'《晨間解盤》下探風險未除',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【時報-台北電】周一台股再探新低14632點。終場加權股價指數數小跌11.94點，收在14661.1點，成交值萎縮至1881.72億元。店頭市場賣壓出籠，跌幅1.5%高於大盤。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">凱基投顧表示，周一多方力圖振作，雖然盤中一度反彈約80點，但最後無功而返，並且再創本波拉回新低14632點。上市電子周一持續走低，創下675.58點新低，並且又領先大盤跌破八月初低點(8/2 677.88點)。短線大盤技術面、指標面及籌碼面持續偏空，類股漲跌架構也朝向負面發展，顯示大盤下探風險未除，後勢仍有低點。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">操作建議保持謹慎，先以控管風險為主，持股汰弱留強，暫待止跌回穩訊號浮現。（編輯：沈培華）</p>',	'/uploads/20220906/7da805714103cf17010cdfc8c0149bbe.jpg',	1662427642,	1662427642),
(45,	'券商晨訊台股投資建議摘要 (1) 2022年9月6日',	'<p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【統一證券】</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">台股各均線呈現空頭排列，上檔明顯壓力在季線14987點位置，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">在季線持續向下牽引下，月線也向下。在台幣超級弱勢下，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">外資持續賣超，盤勢不容樂觀。</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">【國票證券】</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">操作方面，可聚焦面板、太陽能族群，前者具現金減資及面板</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">報價可望觸底題材，後者具市場熱度及技術面、籌碼面優勢，</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; border: 0px; font-family: arial, 苹方-简; color: rgb(0, 0, 0); font-size: 14px; white-space: normal; background-color: rgb(247, 247, 247);\">股價續有表現空間，可持續留意。</p>',	'/uploads/20220906/80fb2020275aee6c98b67bee708be5af.jpg',	1662427712,	1662427712),
(46,	'台股陷低量 金管會將出招',	'',	'/uploads/20220906/7da805714103cf17010cdfc8c0149bbe.jpg',	1662427860,	1662427860);
